"60089":{"id":"60089","name":"Best Player: Guerreiros Virtuais","slug":"best-player-guerreiros-virtuais","original_title":"Best Player","overview":"Chris Sanders e Quincy estão ambos envolvidos em um videogame chamado \"Black Hole\", e ambos querem vencer o torneio com um prêmio de $ 175.500. Quincy então tenta sabotar Chris, mas tudo corre mal, porque a mãe de Chris, Tracy, acha que Quincy é a data da internet. Quincy mente para Tracy no primeiro encontro dizendo que ele é um Home Ec. professor da escola de Chris. Logo antes do torneio, Chris descobre que Quincy estava mentindo sobre tudo. Então, Chris decide que vai \"destruí-lo\" no torneio. Quincy acaba perdendo o torneio para mostrar que ele sinceramente lamenta. Tracy o leva de volta, e eles vão para o baile de finalistas de Chris. Chris decide ir com seu interesse amoroso no filme, Ash.","first_air_date":"2011-03-12","runtime":107,"episode_run_time":[107],"vote_average":6.6,"created_by":["Pacific Bay Entertainment"],"production_companies":[{"name":"Pacific Bay Entertainment"}],"cast":["Jerry Trainor","Jennette McCurdy","Janet Varney","Jean-Luc Bilodeau","Amir Talai"],"backdrop_path":"https://image.tmdb.org/t/p/original/tVOo3ntVQacctgxLyj9gr6bUGou.jpg","poster_path":"https://image.tmdb.org/t/p/original/hIVXQM0X4rawgKa6VFPb84NBqKX.jpg","certification":"10","genres":["Comédia","Família","Cinema TV"],"trailer":"DAZ0W6SA8yE"},
