"18444":{"id":"18444","name":"A Cidadela dos Robinsons","slug":"a-cidadela-dos-robinsons","original_title":"Swiss Family Robinson","overview":"Depois de um naufrágio, a família Robinson fica abandonada em uma ilha habitada apenas por uma impressionante variedade de vida selvagem. Num verdadeiro espírito de pioneiro, eles rapidamente se sentem em casa, mas logo enfrentam um perigo ainda maior do que a natureza: piratas assustadores. É uma aventura estimulante, adequada para toda a família, adaptação Disney do romance clássico de Johann Wyss. Com as estrelas Dorothy McGuire e John Mills como mãe e pai Robinson.","first_air_date":"1960-12-21","runtime":126,"episode_run_time":[126],"vote_average":6.9,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["John Mills","Dorothy McGuire","James MacArthur","Janet Munro","Sessue Hayakawa"],"backdrop_path":"https://image.tmdb.org/t/p/original/vNijAksUUekLP0sMuuGctkSFK2L.jpg","poster_path":"https://image.tmdb.org/t/p/original/iX7dcRZQH5DZf3Y33Uv3poJY8LZ.jpg","certification":"N/A","genres":["Aventura","Família"],"trailer":"N/A"},
"1594":{"id":"1594","name":"Um Tiro no Escuro","slug":"um-tiro-no-escuro","original_title":"A Shot in the Dark","overview":"Em Paris, na mansão de Benjamin Ballon (George Sanders), um conhecido milionário, um crime é cometido e por engano é mandado o Inspetor Jacques Clouseau (Peter Sellers), o mais atrapalhado dos detetives franceses. Enquanto as investigações avançam, novas mortes acontecem e as evidências sugerem que a culpada é Maria Gambrelli (Elke Sommer), uma arrumadeira que trabalha na mansão de Ballon. Entretanto, Clouseau tem certeza da inocência dela e está disposto a investigar o caso (mas sempre de uma forma pouco convencional), para descobrir quem é o culpado ou culpados das mortes.","first_air_date":"1964-06-23","runtime":102,"episode_run_time":[102],"vote_average":7.2,"created_by":["United Artists","The Mirisch Company"],"production_companies":[{"name":"United Artists"},{"name":"The Mirisch Company"}],"cast":["Peter Sellers","Elke Sommer","George Sanders","Herbert Lom","Graham Stark"],"backdrop_path":"https://image.tmdb.org/t/p/original/SExpQgcY5c3UMbBntFIh7xRDg3.jpg","poster_path":"https://image.tmdb.org/t/p/original/5XWlxg5dCt86Cy9nZTuXnceJSo8.jpg","certification":"12","genres":["Comédia","Mistério","Crime"],"trailer":"N/A"},
"12837":{"id":"12837","name":"A Vida Secreta das Abelhas","slug":"a-vida-secreta-das-abelhas","original_title":"The Secret Life of Bees","overview":"A história se passa nos anos 60, no Sul dos Estados Unidos, e conta a história da adolescente Lily Owens (Dakota Fanning) de 14 anos e a amiga Rosaleen (Jennifer Hudson) que fogem da dura criação para descobrir o que aconteceu com a mãe de Lily. No caminho, elas conhecem três irmãs criadoras de abelhas que as conduzem por uma jornada inesquecível.","first_air_date":"2008-09-17","runtime":114,"episode_run_time":[114],"vote_average":7.5,"created_by":["Dune Entertainment III","Fox Searchlight Pictures","The Donners' Company","Overbrook Entertainment"],"production_companies":[{"name":"Dune Entertainment III"},{"name":"Fox Searchlight Pictures"},{"name":"The Donners' Company"},{"name":"Overbrook Entertainment"}],"cast":["Dakota Fanning","Queen Latifah","Jennifer Hudson","Alicia Keys","Sophie Okonedo"],"backdrop_path":"https://image.tmdb.org/t/p/original/3CcO4QdasRCitq2dczOpx7CXgLM.jpg","poster_path":"https://image.tmdb.org/t/p/original/t7x4nZvhJnvjssgdklSgR66NpNi.jpg","certification":"16","genres":["Família","Aventura","Drama"],"trailer":"N/A"},
