"12122":{"id":"12122","name":"A Cidade dos Amaldiçoados","slug":"a-cidade-dos-amaldicoados","original_title":"Village of the Damned","overview":"Na cidade americana de Midwich o médico Alan Chaffee (Christopher Reeve) acorda cedo, pois ouviu sons que pareciam sussurros. Sua mulher, Barbara (Karen Kahn), diz que nada ouviu e Alan deixa de dar importância. Naquela manhã Alan sai da cidade, assim como Frank McGowan (Michael Paré), e às 10 horas ocorre um desmaio coletivo, que só atinge as pessoas e animais que estavam nos limites da cidade. Ao voltar Frank desmaia, seu carro perde a direção e ele morre. Quando Alan retorna o governo já tem consciência do caso e enviou uma equipe, chefiada pela epidemiologista Susan Verner (Kirstie Alley). Após seis horas desmaiados, os animais e pessoas começam a despertar. Depois de enterrarem as vítimas daquele fato inexplicável, se constata que naquele dia várias mulheres ficaram grávidas. Quando nascem os bebês têm características especiais, mas seus \"pais\" sentem que as crianças não são humanas e que representam um sério perigo.","first_air_date":"1995-04-28","runtime":99,"episode_run_time":[99],"vote_average":6.1,"created_by":["Universal Pictures"],"production_companies":[{"name":"Universal Pictures"}],"cast":["Christopher Reeve","Kirstie Alley","Linda Kozlowski","Michael Paré","Meredith Salenger"],"backdrop_path":"https://image.tmdb.org/t/p/original/qaBcFpraT85hwEcQzLvoBHC5kVj.jpg","poster_path":"https://image.tmdb.org/t/p/original/eNPnSDXxrd2psC3jer9nxKvwbOQ.jpg","certification":"N/A","genres":["Thriller","Terror","Ficção científica"],"trailer":"N/A"},
