"468816":{"id":"468816","name":"O Voo do Falcão","slug":"o-voo-do-falcao","original_title":"The Rising Hawk","overview":"O ano é 1241. A horda mongol liderada pelo cruel khan Batu se move para o oeste, destruindo tudo em seu caminho. Chegando às montanhas dos Cárpatos, as tropas acampam logo abaixo. No entanto, à noite, vários caçadores locais, os irmãos Berkut, entram secretamente no acampamento e libertam os reféns. Consumido de raiva, o cã decide se vingar e destruir os assentamentos dos Cárpatos. Um traidor entre os moradores diz aos mongóis sobre uma passagem secreta dentro das montanhas. No entanto, um pequeno grupo de caçadores de montanha liderados por Zakhar Berkut tem seu próprio plano para deter a horda inimiga de uma vez por todas..","first_air_date":"2019-10-10","runtime":135,"episode_run_time":[135],"vote_average":5.9,"created_by":["Kinorob","Cinema Day","Ukrainian State Film Agency"],"production_companies":[{"name":"Kinorob"},{"name":"Cinema Day"},{"name":"Ukrainian State Film Agency"}],"cast":["Alex MacNicoll","Poppy Drayton","Rocky Myers","Аліна Коваленко","Robert Patrick"],"backdrop_path":"https://image.tmdb.org/t/p/original/sxI7nxy18fapiE1XNBuiQaIQhlS.jpg","poster_path":"https://image.tmdb.org/t/p/original/rewaDG5F3oGdAY2AEV6IgXKWfL6.jpg","certification":"N/A","genres":["Ação","História","Drama"],"trailer":"N/A"},
