"14728":{"id":"14728","name":"O Guardião 3: A Maldição do Cálice de Judas","slug":"o-guardiao-3-a-maldicao-do-calice-de-judas","original_title":"The Librarian: The Curse of the Judas Chalice","overview":"Dos mesmos produtores de Independence Day... Em sua terceira aventura, Flynn Carsen, o guardião de relíquias históricas, viaja a Nova Orleans em busca de uma explicação para pesadelos que teve com uma misteriosa garota. Seguindo as mensagens dos sonhos, ele chega a um nightclub onde encontra Simone, a bela mulher com quem sonhou, que também o reconhece e pede sua ajuda numa perigosa expedição. O corpo do vampiro mais notório do mundo, Vlad Dracula, foi roubado de seu túmulo na romênia pelo ambicioso Kubichecj que pretende revive-lo com a ajuda do \"Cálice de Judas\". Feito com prata das 30 moedas recebidas por Judas ao trair Jesus, tal artefato tem o poder de ressuscitar os mortos. Com a ajuda de Simone - que também esconde um aterrorizante segredo - o desajeitado herói precisa encontrar o cálice antes do vilão, enfrentando perigos sobrenaturais e, finalmente, aceitando seu papel de Guardião.","first_air_date":"2008-10-25","runtime":90,"episode_run_time":[90],"vote_average":6.3,"created_by":["Electric Entertainment"],"production_companies":[{"name":"Electric Entertainment"}],"cast":["Noah Wyle","Stana Katic","Jane Curtin","Bob Newhart","Bruce Davison"],"backdrop_path":"https://image.tmdb.org/t/p/original/jmqkMxZMYdNuSh8AjhvrcM0OXtn.jpg","poster_path":"https://image.tmdb.org/t/p/original/4eJQzBF4Z6byEdZw2BOASc666rj.jpg","certification":"N/A","genres":["Fantasia","Aventura","Comédia"],"trailer":"N/A"},
