"264999":{"id":"264999","name":"Magic Mike XXL","slug":"magic-mike-xxl","original_title":"Magic Mike XXL","overview":"Três anos depois de se aposentar da vida como stripper, bem quando estava no auge, Mike encontra com os remanescentes dos Reis de Tampa, também prontos para jogar a toalha. Mas eles querem fazer isso do jeito deles: botando pra quebrar em uma última apresentação em Myrtle Beach e com Magic Mike, a lendária atração do grupo, no palco, junto com eles. Caindo na estrada para suas derradeiras performances, com paradas estratégicas em Jacksonville e Savannah para rever velhos amigos e fazer alguns novos, Mike e seus companheiros aprendem alguns lances novos e reviram o passado de maneira surpreendente.","first_air_date":"2015-07-01","runtime":115,"episode_run_time":[115],"vote_average":6.2,"created_by":["Warner Bros. Pictures","Iron Horse Entertainment"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Iron Horse Entertainment"}],"cast":["Channing Tatum","Matt Bomer","Joe Manganiello","Kevin Nash","Adam Rodriguez"],"backdrop_path":"https://image.tmdb.org/t/p/original/fUIRIO87tBqeS7uc0wLNNqU1yay.jpg","poster_path":"https://image.tmdb.org/t/p/original/A8QhzCsnvK2Gi4ZAXIIYK9VMgwI.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
