"874":{"id":"874","name":"O Homem Que Não Vendeu Sua Alma","slug":"o-homem-que-nao-vendeu-sua-alma","original_title":"A Man for All Seasons","overview":"Na Inglaterra do século XVI, Henrique VIII (Robert Shaw) planeja se separar de sua primeira esposa para se casar com Ana Bolena (Vanessa Redgrave), mas não recebe a aprovação de Thomas More (Paul Scofield), um fervoroso católico que se tornou Lord Chanceler, um altíssimo posto que ele preferiu renunciar a trair suas convicções. Entretanto, a importância de Sir Thomas é tão grande que mesmo após sua renúncia o rei continua lhe perseguindo. Até que surgem “provas” que o incriminam como alta traição, um crime punido com a morte.","first_air_date":"1966-12-13","runtime":120,"episode_run_time":[120],"vote_average":7.3,"created_by":["Highland Films"],"production_companies":[{"name":"Highland Films"}],"cast":["Paul Scofield","Wendy Hiller","Leo McKern","Robert Shaw","Orson Welles"],"backdrop_path":"https://image.tmdb.org/t/p/original/ulO2vXHo8oTOdUWSEwWkGFhq3VL.jpg","poster_path":"https://image.tmdb.org/t/p/original/nlS8n2miCLdG0LSrxdZ9vyE68ea.jpg","certification":"N/A","genres":["Drama","História"],"trailer":"N/A"},
