"185008":{"id":"185008","name":"Essa Louca Juventude","slug":"essa-louca-juventude","original_title":"ये जवानी है दीवानी","overview":"O filme conta a história da relação entre Bunny e Naina, em dois momentos distintos, mas decisivos em suas vidas. Primeiro, quando eles estão apenas de férias da faculdade e estão em uma encruzilhada de várias decisões, que irá moldar quem, e o que eles vão se tornar. Por causa das escolhas de ambos, anos mais tarde, eles se encontram novamente, segurando-se entre sonhos realizados e não realizados, em uma encruzilhada de outra natureza, desta vez.","first_air_date":"2013-05-31","runtime":160,"episode_run_time":[160],"vote_average":7.2,"created_by":["Dharma Productions","UTV Motion Pictures","Eros International"],"production_companies":[{"name":"Dharma Productions"},{"name":"UTV Motion Pictures"},{"name":"Eros International"}],"cast":["Ranbir Kapoor","Deepika Padukone","Aditya Roy Kapur","Kalki Koechlin","Kunaal Roy Kapur"],"backdrop_path":"https://image.tmdb.org/t/p/original/Wi9bgiwfJPYKFcJIiUqCNDFNtf.jpg","poster_path":"https://image.tmdb.org/t/p/original/cNkiZqlH5TsIC16tyzyShBjbcE5.jpg","certification":"N/A","genres":["Romance","Comédia"],"trailer":"N/A"},
"330764":{"id":"330764","name":"O Novíssimo Testamento","slug":"o-novissimo-testamento","original_title":"Le Tout Nouveau Testament","overview":"Deus existe! Ele mora em Bruxelas com a sua filha. Mas a relação entre os dois é tão complicada que a filha decide se vingar do pai, roubando o computador divino e revelando a todos os humanos a data de sua morte. Para conter a crise, Deus volta a viver normalmente entre os homens, descobrindo o verdadeiro caos que é a Terra nos dias de hoje.","first_air_date":"2015-09-02","runtime":114,"episode_run_time":[114],"vote_average":6.7,"created_by":["Caviar","Climax Films","VOO","Orange Studio","Bac Cinema","Terra Incognita Films","Après le Déluge","Belga Productions","RTBF","BeTV","BNP Paribas Fortis"],"production_companies":[{"name":"Caviar"},{"name":"Climax Films"},{"name":"VOO"},{"name":"Orange Studio"},{"name":"Bac Cinema"},{"name":"Terra Incognita Films"},{"name":"Après le Déluge"},{"name":"Belga Productions"},{"name":"RTBF"},{"name":"BeTV"},{"name":"BNP Paribas Fortis"}],"cast":["Pili Groyne","Benoît Poelvoorde","Yolande Moreau","Catherine Deneuve","François Damiens"],"backdrop_path":"https://image.tmdb.org/t/p/original/v3LsiN0K6RQTdxDiJY9DMk9dilW.jpg","poster_path":"https://image.tmdb.org/t/p/original/loAd6xxwucGjogXrxiOXqIMhCdT.jpg","certification":"N/A","genres":["Comédia","Fantasia"],"trailer":"bEJ3oJzD250"},
"869612":{"id":"869612","name":"Jardim dos Desejos","slug":"jardim-dos-desejos","original_title":"Master Gardener","overview":"Narvel Roth é o horticultor meticuloso de Gracewood Gardens, uma bela propriedade de posse da rica viúva Sra. Haverhill. Quando ela ordena que Roth assuma sua problemática sobrinha-neta Maya como sua aprendiz, sua vida é lançada no caos e segredos obscuros de seu passado emergem.","first_air_date":"2023-05-19","runtime":101,"episode_run_time":[101],"vote_average":6.1,"created_by":["Kojo Studios","Ottocento Films","Flickstar","Northern Lights"],"production_companies":[{"name":"Kojo Studios"},{"name":"Ottocento Films"},{"name":"Flickstar"},{"name":"Northern Lights"}],"cast":["Joel Edgerton","Sigourney Weaver","Quintessa Swindell","Esai Morales","Eduardo Losan"],"backdrop_path":"https://image.tmdb.org/t/p/original/kmsC7wvrKbla7kCg6YTWHtxmaGI.jpg","poster_path":"https://image.tmdb.org/t/p/original/7CRGkkZkJMEv3Fp5Qf4SQbGz6Td.jpg","certification":"14","genres":["Drama","Crime","Mistério","Thriller"],"trailer":"-rNXVCCBZ5s"},
"11856":{"id":"11856","name":"Air America: Loucos Pelo Perigo","slug":"air-america-loucos-pelo-perigo","original_title":"Air America","overview":"Gene Ryack é um piloto contratado pela CIA para, sob disfarce, para transportar abastecimentos durante a Guerra do Vietnã. Ao mesmo tempo, ele tenta conciliar o tempo com o seu negócio pessoal de contrabando de armas. Mas tudo parece desandar quando ele recebe a companhia de um recruta, Billy Covington, um jovem rebelde que fora dispensado do seu último trabalho.","first_air_date":"1990-08-10","runtime":112,"episode_run_time":[112],"vote_average":5.8,"created_by":["IndieProd Company Productions","Carolco Pictures"],"production_companies":[{"name":"IndieProd Company Productions"},{"name":"Carolco Pictures"}],"cast":["Mel Gibson","Robert Downey Jr.","Nancy Travis","Ken Jenkins","David Marshall Grant"],"backdrop_path":"https://image.tmdb.org/t/p/original/8Hxzj5RLOMpcb4IzAvCRCgrqXZX.jpg","poster_path":"https://image.tmdb.org/t/p/original/45i3yKCzM9DoicnWtrVgx5IWA0.jpg","certification":"12","genres":["Ação","Aventura","Comédia","Drama"],"trailer":"N/A"},
"308453":{"id":"308453","name":"Medalha de Bronze","slug":"medalha-de-bronze","original_title":"The Bronze","overview":"Em 2004, Hope Ann Gregory virou uma heroína americana depois de ganhar uma medalha de bronze para o time de ginástica feminino. Hoje em dia, ela ainda vive na sua pequena cidade natal, esquecida e amargurada. Presa ao passado, Hope deve reavaliar sua vida quando uma jovem ginasta promissora ameaça seu status de celebridade local.","first_air_date":"2016-01-22","runtime":108,"episode_run_time":[108],"vote_average":6.0,"created_by":["Duplass Brothers Productions"],"production_companies":[{"name":"Duplass Brothers Productions"}],"cast":["Melissa Rauch","Gary Cole","Thomas Middleditch","Sebastian Stan","Cecily Strong"],"backdrop_path":"https://image.tmdb.org/t/p/original/57b4FmA9aSNE6wiL439DlKFS5TY.jpg","poster_path":"https://image.tmdb.org/t/p/original/rz4EQRkGCAR3ITviEp2d89rCDrh.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"N/A"},
"421473":{"id":"421473","name":"Crime e Desejo","slug":"crime-e-desejo","original_title":"Above Suspicion","overview":"Um rapaz recém-casado se torna o representante do FBI numa cidade montanhosa de Kentucky. Lá, ele é atraído para um caso ilícito com uma mulher local pobre que se torna seu melhor informante. Ela vê nele seu meio de fuga, mas a investigação se torna desastrosa para ambos e vira um escândalo que abalou os alicerces da principal agência policial do país.","first_air_date":"2019-06-20","runtime":104,"episode_run_time":[104],"vote_average":5.9,"created_by":["Bold Films","Colleen Camp Productions","Sierra/Affinity","Voltage Pictures"],"production_companies":[{"name":"Bold Films"},{"name":"Colleen Camp Productions"},{"name":"Sierra/Affinity"},{"name":"Voltage Pictures"}],"cast":["Emilia Clarke","Jack Huston","Johnny Knoxville","Thora Birch","Sophie Lowe"],"backdrop_path":"https://image.tmdb.org/t/p/original/ytkkEnltVidJZ6H4C74Jlo114cf.jpg","poster_path":"https://image.tmdb.org/t/p/original/h41DZREsYkm9Nq0HZ9YMP2pWlJg.jpg","certification":"16","genres":["Thriller","Crime","Ação"],"trailer":"N/A"},
