"29710":{"id":"29710","name":"Khartoum","slug":"khartoum","original_title":"Khartoum","overview":"Depois que o exército egípcio, comandada por oficiais britânicos, é destruído em uma batalha no Sudão em 1880, o governo britânico está em um dilema. Ele não querem enviar uma força militar britânica para uma guerra estrangeira, mas eles têm o compromisso de proteger os egípcios em Cartum. Eles decidem pedir o general Charles \"Chinês\" Gordon, que era uma espécie de herói popular no Sudão por ter acabado com o comércio de escravos na área, para providenciar a evacuação. Gordon concorda, mas também decide defender a cidade contra as forças do Mahdi - O Esperado - e tenta forçar os britânicos a enviar tropas.","first_air_date":"1966-06-09","runtime":137,"episode_run_time":[137],"vote_average":6.3,"created_by":["Julian Blaustein Productions Ltd.","United Artists"],"production_companies":[{"name":"Julian Blaustein Productions Ltd."},{"name":"United Artists"}],"cast":["Charlton Heston","Laurence Olivier","Richard Johnson","Ralph Richardson","Alexander Knox"],"backdrop_path":"https://image.tmdb.org/t/p/original/fb9k7H14y7htb4VBYiaAlko689M.jpg","poster_path":"https://image.tmdb.org/t/p/original/lcqulOKVAPkyEbvvYtPYgVQazWD.jpg","certification":"N/A","genres":["História","Guerra","Aventura"],"trailer":"N/A"},
