"70868":{"id":"70868","name":"Não Sei Como Ela Consegue","slug":"nao-sei-como-ela-consegue","original_title":"I Don't Know How She Does It","overview":"Kate Reddy (Sarah Jessica Parker) é o modelo da mulher moderna, dividindo seu tempo entre os afazeres domésticos como mãe de família e os profissionais, decorrentes de seu trabalho. Ela sofre com a falta de tempo para o marido Richard (Greg Kinnear) e os filhos Emily (Emma Rayne Lily) e Ben (Julius Goldberg/Theodore Goldberg), um problema que aumenta ainda mais quando passa a trabalhar com Jack Abelhammer (Pierce Brosnan) na criação de um fundo.","first_air_date":"2011-09-16","runtime":89,"episode_run_time":[89],"vote_average":5.2,"created_by":["The Weinstein Company"],"production_companies":[{"name":"The Weinstein Company"}],"cast":["Sarah Jessica Parker","Pierce Brosnan","Greg Kinnear","Christina Hendricks","Kelsey Grammer"],"backdrop_path":"https://image.tmdb.org/t/p/original/f2WjZXaEAp8eAxCFiRCbfbu84U2.jpg","poster_path":"https://image.tmdb.org/t/p/original/ynmH0BIgFoqkzIJjXhVq12bTMfE.jpg","certification":"N/A","genres":["Romance","Comédia"],"trailer":"N/A"},
