"582206":{"id":"582206","name":"O Melhor está por vir","slug":"o-melhor-esta-por-vir","original_title":"Le Meilleur reste à venir","overview":"Arthur (Fabrice Luchini) e César (Patrick Bruel) são dois grandes amigos, daqueles que nutrem um forte laço desde os tempos da infância. Por uma ironia do destino e um mal-entendido, César acredita que Arthur irá morrer dentro de pouco tempo, vítima de câncer. Com o objetivo de transformar os últimos momentos do amigo em algo muito especial, ele decide ficar ao seu lado para que possam fazer juntos tudo o que o outro deseja, enquanto isso é possível. O único detalhe que César ainda não sabe que é justamente ele o paciente terminal e Arthur reluta em contar e estragar a felicidade do amigo. Dos mesmos criadores do sucesso Qual o Nome do Bebê? (2012).","first_air_date":"2019-12-04","runtime":115,"episode_run_time":[115],"vote_average":6.8,"created_by":["Chapter 2","Pathé","M6 Films","CN8 Productions","Belga Productions","Onyx Films","Fargo Films"],"production_companies":[{"name":"Chapter 2"},{"name":"Pathé"},{"name":"M6 Films"},{"name":"CN8 Productions"},{"name":"Belga Productions"},{"name":"Onyx Films"},{"name":"Fargo Films"}],"cast":["Fabrice Luchini","Patrick Bruel","Zineb Triki","Pascale Arbillot","Marie Narbonne"],"backdrop_path":"https://image.tmdb.org/t/p/original/3eGj3Jcp7eP4yDh7LccmV6XwW6v.jpg","poster_path":"https://image.tmdb.org/t/p/original/scjDcAaxscXJeRUkBjNFOwqc7W.jpg","certification":"L","genres":["Comédia","Drama"],"trailer":"N/A"},
