"9388":{"id":"9388","name":"Obrigado Por Fumar","slug":"obrigado-por-fumar","original_title":"Thank You for Smoking","overview":"Nick Naylor (Aaron Eckhart) é o principal porta-voz das grandes empresas de cigarros, ganhando a vida defendendo os direitos dos fumantes nos Estados Unidos. Desafiado pelos vigilantes da saúde e também por um senador oportunista, Ortolan K. Finistirre (William H. Macy), que deseja colocar rótulos de veneno nos maços de cigarros, Nick passa a manipular informações de forma a diminuir os riscos do cigarro em programas de TV. Além disto Nick conta com a ajuda de Jeff Megall (Rob Lowe), um poderoso agente de Hollywood, para fazer com que o cigarro seja promovido nos filmes. Sua fama faz com que Nick atraia a atenção dos principais chefes da indústria do tabaco e também de Heather Holloway (Katie Holmes), a repórter de um jornal de Washington que deseja investigá-lo. Nick repetidamente diz que trabalha apenas para pagar as contas, mas a atenção cada vez maior que seu filho Joey (Cameron Bright) dá ao seu trabalho começa a preocupá-lo.","first_air_date":"2005-09-09","runtime":92,"episode_run_time":[92],"vote_average":7.2,"created_by":["ContentFilm","Major Studio Partners","Room 9 Entertainment","Fox Searchlight Pictures","David O. Sacks Productions"],"production_companies":[{"name":"ContentFilm"},{"name":"Major Studio Partners"},{"name":"Room 9 Entertainment"},{"name":"Fox Searchlight Pictures"},{"name":"David O. Sacks Productions"}],"cast":["Aaron Eckhart","Maria Bello","Cameron Bright","Adam Brody","Sam Elliott"],"backdrop_path":"https://image.tmdb.org/t/p/original/f2Gdaux9j6FF39oNj0Cpfooje4m.jpg","poster_path":"https://image.tmdb.org/t/p/original/1TnnktqvgWLerkBJXkB2v9qRs7U.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
"581526":{"id":"581526","name":"Livrai-nos do Mal","slug":"livrai-nos-do-mal","original_title":"다만 악에서 구하소서","overview":"In-nam, um assassino contratado que mais recentemente completou seu contrato final, descobre que a vítima de sequestro pode ser seu parente mais próximo. Ele parte imediatamente para a Tailândia para investigar e recruta Yui para obter ajuda e juntos correm contra o tempo para encontrar a criança sequestrada. Enquanto isso, Ray descobre que seu irmão foi morto pelo In-nam e vai atrás dele, deixando um grande número de corpos em sua busca para buscar sua vingança...","first_air_date":"2020-08-05","runtime":108,"episode_run_time":[108],"vote_average":6.9,"created_by":["Hive Media Corp","CJ Entertainment"],"production_companies":[{"name":"Hive Media Corp"},{"name":"CJ Entertainment"}],"cast":["황정민","Lee Jung-jae","박정민","최희서","오대환"],"backdrop_path":"https://image.tmdb.org/t/p/original/iJDyvQuTMp0ByKrz0KB8eUXJVst.jpg","poster_path":"https://image.tmdb.org/t/p/original/oZu6D88XVuxJ7hEZIM1bIWUcUS6.jpg","certification":"N/A","genres":["Crime","Ação","Drama"],"trailer":"N/A"},
"1600":{"id":"1600","name":"A Dupla Vida de Véronique","slug":"a-dupla-vida-de-veronique","original_title":"La Double Vie de Véronique","overview":"Weronika vive na Polónia. Véronique vive em Paris. Não se conhecem e não tem nenhuma relação. No entanto, são idênticas: ambas são esquerdinas, gostam de andar descalças, têm o mesmo brilho no olhar, uma voz sublime, um sentido musical absoluto e, acima de tudo, partilham o mesmo problema cardíaco dificilmente detectável. Sem o saber, uma irá beneficiar das experiências e sabedoria da outra. Como se cada vez que a primeira se magoasse com um qualquer objecto a segunda evitasse tocar no mesmo. Em França, Véronique descobre o amor na figura de um escritor e criador de teatro de marionetas...","first_air_date":"1991-05-15","runtime":98,"episode_run_time":[98],"vote_average":7.5,"created_by":["Sidéral Productions","Norsk Film","Studio Filmowe Tor","Le Studio Canal+"],"production_companies":[{"name":"Sidéral Productions"},{"name":"Norsk Film"},{"name":"Studio Filmowe Tor"},{"name":"Le Studio Canal+"}],"cast":["Irène Jacob","Halina Gryglaszewska","Philippe Volter","Guillaume de Tonquédec","Kalina Jędrusik"],"backdrop_path":"https://image.tmdb.org/t/p/original/vjsFyeCf5W5rxCFpS9MIAEZJkIG.jpg","poster_path":"https://image.tmdb.org/t/p/original/pQ25yX2PaqqCnQcEBLss1OdouMB.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
