"10640":{"id":"10640","name":"Mundo Futuro: Ano 2003, Operação Terra","slug":"mundo-futuro-ano-2003-operacao-terra","original_title":"Futureworld","overview":"Após o fracasso do parque de diversões Delos, que abalou a credibilidade da corporação responsável e causou prejuízos enormes, um bilhão e quinhentos milhões de dólares foram investidos para refazer todo o centro. Chuck Browning, um repórter pouco lido, e Tracy Ballard, uma entrevistadora de enorme popularidade, são convidados a fazerem uma reportagem para que atestem que tudo agora é seguro. Porém logo os dois jornalistas desconfiam que há algo muito estranho e descobrem que há um plano para substituir os principais líderes do mundo por andróides perfeitos. Inclusive existem cópias deles mesmos, com os robôs sendo programados para jamais criticarem o parque Delos e acatarem todas as ordens que de lá venham.","first_air_date":"1976-08-13","runtime":107,"episode_run_time":[107],"vote_average":5.9,"created_by":["American International Pictures","The Aubrey Company"],"production_companies":[{"name":"American International Pictures"},{"name":"The Aubrey Company"}],"cast":["Peter Fonda","Blythe Danner","Arthur Hill","Yul Brynner","John P. Ryan"],"backdrop_path":"https://image.tmdb.org/t/p/original/7PSLLtj7i94WSQ3Svjv7qHevj2n.jpg","poster_path":"https://image.tmdb.org/t/p/original/aKuKfGTXc2u5gHbUx0gQcRiFjPc.jpg","certification":"N/A","genres":["Ação","Aventura","Ficção científica","Thriller"],"trailer":"N/A"},
