"9899":{"id":"9899","name":"Os Produtores","slug":"os-produtores","original_title":"The Producers","overview":"Max Bialystock (Nathan Lane) é um produtor teatral astuto, que tem Leo Bloom (Matthew Broderick) como contador. Um dia Leo surge com o plano perfeito para conseguir muito dinheiro: arrecadar muito mais do que o necessário para produzir um show para a Broadway, que seja de antemão um fracasso garantido. A ideia é que, por ser um fracasso, nenhum investidor espera receber algo, o que permitiria que Max e Leo embolsassem a diferença. A dupla segue o plano, iniciando a busca pela pior peça teatral já escrita. A escolhida é o musical \"Primavera para Hitler\", escrito por Franz Liebkind (Will Ferrell). Logo que começam a produção, contratam Ulla Inga Hansen-Bensen-Yanson-Tallen-Hallen-Svaden-Swanson (Uma Thurman) como secretária que terá um papel no espetáculo. Mas, para a surpresa de Max e Leo, a peça se torna um estrondoso sucesso. Baseado na mesma história já filmada, Primavera Para Hitler (1967).","first_air_date":"2005-12-25","runtime":135,"episode_run_time":[135],"vote_average":6.2,"created_by":["Universal Pictures","Columbia Pictures","Brooksfilms"],"production_companies":[{"name":"Universal Pictures"},{"name":"Columbia Pictures"},{"name":"Brooksfilms"}],"cast":["Nathan Lane","Matthew Broderick","Uma Thurman","Will Ferrell","Gary Beach"],"backdrop_path":"https://image.tmdb.org/t/p/original/8PU4tUGUdrKujKwkUkw3M9ZrAaw.jpg","poster_path":"https://image.tmdb.org/t/p/original/fWhHnrl0m0LCmrUD28qDIMggD96.jpg","certification":"12","genres":["Comédia"],"trailer":"N/A"},
"300803":{"id":"300803","name":"Coração de Dragão 3: A Maldição do Feiticeiro","slug":"coracao-de-dragao-3-a-maldicao-do-feiticeiro","original_title":"Dragonheart 3: The Sorcerer's Curse","overview":"Quando o aspirante à cavaleiro Gareth (Julian Morris) sai em busca de um cometa caído com boatos de que possa conter ouro, ele fica chocado ao encontrar na verdade o dragão Drago (voz de Ben Kingsley). Após Drago salvar a vida de Gareth os dois tornam-se intrinsecamente ligados, e devem trabalhar juntos para derrotar um malvado feiticeiro e parar seu reinado de terror. Ao longo do caminho, Gareth aprende o verdadeiro significado de ser um cavaleiro nesta ação-aventura de fantasia para as idades.","first_air_date":"2015-02-24","runtime":97,"episode_run_time":[97],"vote_average":5.4,"created_by":["Raffaella Productions"],"production_companies":[{"name":"Raffaella Productions"}],"cast":["Julian Morris","Tamzin Merchant","Ben Kingsley","Jassa Ahluwalia","Jonjo O'Neill"],"backdrop_path":"https://image.tmdb.org/t/p/original/rbA4CkeT2ag0RksiIbHSlQnqZRv.jpg","poster_path":"https://image.tmdb.org/t/p/original/v7ex0EwdFnLhaXRELVA78w5R8qF.jpg","certification":"N/A","genres":["Fantasia"],"trailer":"N/A"},
"276839":{"id":"276839","name":"Lar Doce Inferno","slug":"lar-doce-inferno","original_title":"Home Sweet Hell","overview":"Don Champagne parece ter tudo: um negócio próspero, uma casa perfeita, filhos perfeitos e uma mulher perfeita. Infelizmente, quando Mona, a esposa, descobre que uma vendedora jovem e linda é amante dele, esse pedacinho suburbano do paraíso sai totalmente do controle. Don logo percebe que Mona vai fazer de tudo, inclusive matar, para manter a vida de conto de fadas deles, em que o \"Ponto de Vista é Tudo\".","first_air_date":"2015-03-13","runtime":98,"episode_run_time":[98],"vote_average":5.4,"created_by":["Passcode Entertainment","Darko Entertainment","Donnybrook4 Productions","Stage 6 Films"],"production_companies":[{"name":"Passcode Entertainment"},{"name":"Darko Entertainment"},{"name":"Donnybrook4 Productions"},{"name":"Stage 6 Films"}],"cast":["Katherine Heigl","Patrick Wilson","Madison Wolfe","Aiden Flowers","Jordana Brewster"],"backdrop_path":"https://image.tmdb.org/t/p/original/c4sKPgyJj19GBCAvUjpPRiiA45.jpg","poster_path":"https://image.tmdb.org/t/p/original/fpBzu5ekoaDlzr1I6LO5ertxJkn.jpg","certification":"N/A","genres":["Comédia","Thriller"],"trailer":"N/A"},
"369894":{"id":"369894","name":"A Vida Em Espera","slug":"a-vida-em-espera","original_title":"Wakefield","overview":"Howard leva uma vida muito bem estruturada, ele trabalha como advogado em Manhattan e mora em uma casa confortável nos subúrbios com a esposa e os filhos. No entanto, ele se sente extremamente sufocado e, após sofrer um surto, decide se mudar para o sótão sem avisar a família. Os dias viram meses enquanto Howard observa de perto o dia a dia daqueles que ama sem saber se é possível retornar, eventualmente, para a antiga rotina que deixou para trás.","first_air_date":"2017-05-19","runtime":106,"episode_run_time":[106],"vote_average":6.2,"created_by":["Mockingbird Pictures","Dominion Pictures"],"production_companies":[{"name":"Mockingbird Pictures"},{"name":"Dominion Pictures"}],"cast":["Bryan Cranston","Jennifer Garner","Jason O'Mara","Beverly D'Angelo","Ian Anthony Dale"],"backdrop_path":"https://image.tmdb.org/t/p/original/kxxbMVSyhOkrSkZ5vrt5JITMIqG.jpg","poster_path":"https://image.tmdb.org/t/p/original/rrrhS0VLaSmOfPmi2UPOQMcO58h.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
