"149509":{"id":"149509","name":"Amaldiçoado","slug":"amaldicoado","original_title":"Horns","overview":"Um jovem de 26 anos de idade descobre um dia, quando acorda, que sua namorada foi estuprada e assassinada. Ele é imediatamente apontado como principal suspeito, o que o obriga a partir em busca do verdadeiro responsável. Sua arma será o par de chifres que crescem em sua cabeça, e forçam as pessoas que lhe encontram a revelarem seus segredos.","first_air_date":"2013-09-06","runtime":120,"episode_run_time":[120],"vote_average":6.3,"created_by":["Mandalay Pictures","Red Granite Pictures"],"production_companies":[{"name":"Mandalay Pictures"},{"name":"Red Granite Pictures"}],"cast":["Daniel Radcliffe","Juno Temple","Max Minghella","Joe Anderson","Kelli Garner"],"backdrop_path":"https://image.tmdb.org/t/p/original/mORSowyx92dlvx9zYOKXZx0NpAW.jpg","poster_path":"https://image.tmdb.org/t/p/original/6qvHMQ4xGrrBLymsKwPuvEyW62p.jpg","certification":"N/A","genres":["Drama","Fantasia","Thriller"],"trailer":"N/A"},
"17664":{"id":"17664","name":"Marcha de Heróis","slug":"marcha-de-herois","original_title":"The Horse Soldiers","overview":"Baseado em um incidente da Guerra Civil americana, Marcha de Heróis mostra a coragem e determinação de uma tropa da Cavalaria que consegue se infiltrar em território inimigo para cumprir uma missão arriscada. Eles precisam eliminar uma base rebelde sulista que resiste bravamente a todos os ataques. Sem favorecer o Norte ou o Sul, o filme se tornou um tributo emocionante aos homens que lutaram e morreram nesta guerra entre irmãos. John Wayne, William Holden e o diretor John Ford se unem para criar um filme empolgante, repleto de ação, humor e romance que agrada a todos os estilos e idades.","first_air_date":"1959-06-11","runtime":115,"episode_run_time":[115],"vote_average":7.0,"created_by":["United Artists","Mahin-Rackin"],"production_companies":[{"name":"United Artists"},{"name":"Mahin-Rackin"}],"cast":["John Wayne","William Holden","Constance Towers","Judson Pratt","Hoot Gibson"],"backdrop_path":"https://image.tmdb.org/t/p/original/oquDYG2NRGc5A9KwUz79UI9zDKY.jpg","poster_path":"https://image.tmdb.org/t/p/original/sDIuinq3XV3OtnEqTC9NzUb7czL.jpg","certification":"12","genres":["Faroeste","Guerra"],"trailer":"N/A"},
