"17606":{"id":"17606","name":"O Amante","slug":"o-amante","original_title":"The Other Man","overview":"Peter (Liam Neeson) e Lisa (Laura Linney) são casados e levam uma vida pacata. Ele dirige sua própria companhia, enquanto que ela é designer de sapatos. Até que, na festa de lançamento de sua última coleção, Lisa pergunta a Peter se jamais desejara ficar com outra pessoa. Logo em seguida desaparece, o que o leva ao desespero. Tentando encontrá-la ele segue à Itália, onde conhece Ralph (Antonio Banderas). Peter sabe que ele é o amante de sua esposa, mas Ralph guarda alguns segredos.","first_air_date":"2008-12-25","runtime":90,"episode_run_time":[90],"vote_average":5.4,"created_by":["Rainmark Films"],"production_companies":[{"name":"Rainmark Films"}],"cast":["Liam Neeson","Antonio Banderas","Laura Linney","Romola Garai","Abigail Canton"],"backdrop_path":"https://image.tmdb.org/t/p/original/fY0oDU9Tq9U2gROvwqIRFgiPDGJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/yRXanDbDPKKhzzAc3nHOcmBhxTZ.jpg","certification":"N/A","genres":["Drama","Thriller","Mistério","Romance"],"trailer":"N/A"},
