"50357":{"id":"50357","name":"Apollo 18","slug":"apollo-18","original_title":"Apollo 18","overview":"Oficialmente, a Apollo 17 foi a última missão tripulada à Lua, tendo sido lançada em 17 de dezembro de 1972. Só que, um ano depois, foi enviado ao satélite uma missão sigilosa, a Apollo 18, financiada pelo Departamento de Defesa dos Estados Unidos. Apenas dois astronautas foram enviados e ambos não sabiam o que estavam por enfrentar. Quando um deles encontra um capacete rachado em pleno solo lunar eles percebem que há algo de errado ali.","first_air_date":"2011-07-20","runtime":86,"episode_run_time":[86],"vote_average":5.3,"created_by":["Bazelevs Production","Dimension Films","Bekmambetov Projects Ltd."],"production_companies":[{"name":"Bazelevs Production"},{"name":"Dimension Films"},{"name":"Bekmambetov Projects Ltd."}],"cast":["Ryan Robbins","Warren Christie","Lloyd Owen","Andrew Airlie","Michael Kopsa"],"backdrop_path":"https://image.tmdb.org/t/p/original/4HAF3vOCHnCwLD2jLS6MN57HQ2n.jpg","poster_path":"https://image.tmdb.org/t/p/original/a9EPf0iGlIVF8EeUgOXlAUaoWM.jpg","certification":"12","genres":["Terror","Thriller","Ficção científica"],"trailer":"N/A"},
