"525554":{"id":"525554","name":"Lukas","slug":"lukas","original_title":"Lukas","overview":"A trama segue Lukas (Van Damme), um segurança de boate em seus 50 anos e que luta para criar sua filha de 8 anos. Um dia, depois de uma briga ele acaba na prisão, e sua filha é colocada sob os cuidados dos serviços sociais. Mas as coisas mudam quando a Interpol recruta Lukas para derrubar um líder holandês que opera da Bélgica em troca da custódia de sua filha.","first_air_date":"2018-08-22","runtime":84,"episode_run_time":[84],"vote_average":6.3,"created_by":["Labyrinthe Films","Atchafalaya Films","uMedia","10.80 Films","Rodin Entertainment","Proximus","RTBF","Canal+","Ciné+","CStar","Telenet","SofiTVciné 6","Wallimage","C8 Films"],"production_companies":[{"name":"Labyrinthe Films"},{"name":"Atchafalaya Films"},{"name":"uMedia"},{"name":"10.80 Films"},{"name":"Rodin Entertainment"},{"name":"Proximus"},{"name":"RTBF"},{"name":"Canal+"},{"name":"Ciné+"},{"name":"CStar"},{"name":"Telenet"},{"name":"SofiTVciné 6"},{"name":"Wallimage"},{"name":"C8 Films"}],"cast":["Jean-Claude Van Damme","Sami Bouajila","Sveva Alviti","Kevin Janssens","Sam Louwyck"],"backdrop_path":"https://image.tmdb.org/t/p/original/mAWMorHkrbBvsfBv8XiE6qbCY9L.jpg","poster_path":"https://image.tmdb.org/t/p/original/z2Ujt0FwMwHhAo7QJC0u1HG1m1h.jpg","certification":"N/A","genres":["Ação","Drama","Thriller"],"trailer":"N/A"},
"140":{"id":"140","name":"Má Educação","slug":"ma-educacao","original_title":"La mala educación","overview":"Nos anos 1960, dois meninos descobrem o amor, o medo e o abuso num internato católico. O diretor da escola presencia e faz parte das descobertas. Os três se reencontram muitos anos depois, e suas ações passadas e novas vidas se entrelaçam de formas criativas e destrutivas.","first_air_date":"2004-03-19","runtime":106,"episode_run_time":[106],"vote_average":7.4,"created_by":["Canal+ España","El Deseo","TVE","Instituto de la Cinematografía y de las Artes Audiovisuales","MEDIA Programme of the European Union"],"production_companies":[{"name":"Canal+ España"},{"name":"El Deseo"},{"name":"TVE"},{"name":"Instituto de la Cinematografía y de las Artes Audiovisuales"},{"name":"MEDIA Programme of the European Union"}],"cast":["Gael García Bernal","Fele Martínez","Daniel Giménez Cacho","Lluís Homar","Francisco Maestre"],"backdrop_path":"https://image.tmdb.org/t/p/original/wNFiDhGnrnSfyqYxzeAa8mFnUhj.jpg","poster_path":"https://image.tmdb.org/t/p/original/6uLAbLs2ea67B8cmFQWJKckgspl.jpg","certification":"18","genres":["Drama","Crime"],"trailer":"N/A"},
"9549":{"id":"9549","name":"Os Eleitos: Onde o Futuro Começa","slug":"os-eleitos-onde-o-futuro-comeca","original_title":"The Right Stuff","overview":"O livro de Tom Wolfe que conta a história do programa espacial norte-americano foi escrito como um romance, e o filme tem a mesma qualidade ficcional. Ele cobre desde a quebra da barreira do som por Chuck Yeager até aos astronautas da Mercury 7, mostrando que ninguém tinha a menor ideia de como executar um programa espacial ou como selecionar as pessoas para participarem. Os sete eleitos são Alan Shepard, John Glenn, Gordon Cooper, Gus Grissom, Scott Carpenter, Wally Schirra e Deke Slayton. Emocionante, engraçado, charmoso e eletrizante ao mesmo tempo.","first_air_date":"1983-10-20","runtime":193,"episode_run_time":[193],"vote_average":7.4,"created_by":["The Ladd Company","Warner Bros. Pictures"],"production_companies":[{"name":"The Ladd Company"},{"name":"Warner Bros. Pictures"}],"cast":["Sam Shepard","Scott Glenn","Ed Harris","Dennis Quaid","Fred Ward"],"backdrop_path":"https://image.tmdb.org/t/p/original/meskam3pXkGw5i1wX5y8L4sQrtV.jpg","poster_path":"https://image.tmdb.org/t/p/original/xlklPwU7VNj799oGPNnE3Gl4l3p.jpg","certification":"10","genres":["Drama","História","Aventura"],"trailer":"N/A"},
