"81250":{"id":"81250","name":"Um Geek Encantador","slug":"um-geek-encantador","original_title":"Geek Charming","overview":"O sonho de Dylan Schoenfield é ser eleita a rainha do baile da escola. Após a bolsa da jovem cair em uma fonte, Josh Rosen a recupera e pede a Dylan que ela seja a estrela de seu documentário sobre popularidade. Ao longo das filmagens, o casal terá de lidar com suas diferenças e algo mais que surgirá entre eles.","first_air_date":"2011-11-11","runtime":97,"episode_run_time":[97],"vote_average":6.7,"created_by":["Mandeville Films","Bad Angels Productions, Ltd."],"production_companies":[{"name":"Mandeville Films"},{"name":"Bad Angels Productions, Ltd."}],"cast":["Sarah Hyland","Matt Prokop","Vanessa Morgan","Sasha Pieterse","Lili Simmons"],"backdrop_path":"https://image.tmdb.org/t/p/original/5btPLADkUW3gxzIs25VdqRAOMtB.jpg","poster_path":"https://image.tmdb.org/t/p/original/9k9Ky1iCxRLiEjYpgAtoxtVMa92.jpg","certification":"N/A","genres":["Comédia","Drama","Família","Cinema TV"],"trailer":"N/A"},
