"8870":{"id":"8870","name":"Planeta Vermelho","slug":"planeta-vermelho","original_title":"Red Planet","overview":"Em um futuro apocalíptico, no ano de 2045, a Terra enfrenta uma crise ecológica, como consequência da poluição e da superpopulação. Entretanto, têm missões interplanetárias à Marte, com o objetivo de produzir algas na primeira etapa de terraformação do planeta vermelho. Doze anos depois, quando a quantidade de oxigênio produzido pelas algas tem uma queda inexplicável, a tripulação da Mars-1 é enviada para verificar o que causou a queda nos níveis de oxigênio e assim continuar a missão de terraformação do planeta vermelho para a futura colonização humana.","first_air_date":"2000-11-10","runtime":106,"episode_run_time":[106],"vote_average":5.7,"created_by":["Mars Production","Village Roadshow Pictures","NPV Entertainment","The Canton Company","Warner Bros. Pictures"],"production_companies":[{"name":"Mars Production"},{"name":"Village Roadshow Pictures"},{"name":"NPV Entertainment"},{"name":"The Canton Company"},{"name":"Warner Bros. Pictures"}],"cast":["Val Kilmer","Carrie-Anne Moss","Benjamin Bratt","Tom Sizemore","Simon Baker"],"backdrop_path":"https://image.tmdb.org/t/p/original/nOHKrmn2H1buOGEHPBh9HL2M8eg.jpg","poster_path":"https://image.tmdb.org/t/p/original/zLNe1qndPl7wBhwW21Tw9olr4z3.jpg","certification":"N/A","genres":["Thriller","Ação","Ficção científica"],"trailer":"N/A"},
