"21481":{"id":"21481","name":"Twitches: As Bruxinhas Gêmeas","slug":"twitches-as-bruxinhas-gemeas","original_title":"Twitches","overview":"Duas jovens bruxinhas são separadas uma da outra ao nascerem e adotadas por famílias diferentes. As irmãs gêmeas se reencontram no dia em que completam 21 anos e descobrem que seus misteriosos poderes mágicos ficam ainda mais fortes quando estão juntas. O que elas não sabem é que elas têm que usar estes poderes para lutar contra as forças do mal e salvar o lugar onde nasceram, onde vive sua mãe verdadeira.","first_air_date":"2005-10-14","runtime":86,"episode_run_time":[86],"vote_average":6.8,"created_by":["Disney Channel","Carla Singer Productions"],"production_companies":[{"name":"Disney Channel"},{"name":"Carla Singer Productions"}],"cast":["Tia Mowry","Tamera Mowry-Housley","Kristen Wilson","Patrick Fabian","Pat Kelly"],"backdrop_path":"https://image.tmdb.org/t/p/original/biWonOe1GrPEMqvXhr7FbLox6xt.jpg","poster_path":"https://image.tmdb.org/t/p/original/gh38WKlXn3GX3ujh8gxsGvCC4iV.jpg","certification":"L","genres":["Comédia","Drama","Família","Fantasia","Cinema TV"],"trailer":"N/A"},
"146239":{"id":"146239","name":"De Repente Pai","slug":"de-repente-pai","original_title":"Delivery Man","overview":"Nesta comédia comovente, o fracassado David Wozniak descobre que é na verdade um sucesso em um assunto: ele é pai de 533 crianças através de doações feitas há vinte anos! David logo descobre que o choque de sua vida pode ser a melhor coisa que já lhe aconteceu. Ao longo do caminho, ele descobre não só o seu verdadeiro eu, mas também o pai que ele poderia se tornar.","first_air_date":"2013-10-10","runtime":105,"episode_run_time":[105],"vote_average":6.2,"created_by":["DreamWorks Pictures","Reliance Entertainment","André Rouleau Productions","Touchstone Pictures"],"production_companies":[{"name":"DreamWorks Pictures"},{"name":"Reliance Entertainment"},{"name":"André Rouleau Productions"},{"name":"Touchstone Pictures"}],"cast":["Vince Vaughn","Cobie Smulders","Chris Pratt","Britt Robertson","Jack Reynor"],"backdrop_path":"https://image.tmdb.org/t/p/original/sbFcNaLJUwMr4XlqwfJiZhy7c6u.jpg","poster_path":"https://image.tmdb.org/t/p/original/4iviSGM2KWEUDhU4m8ujyN9MI6K.jpg","certification":"12","genres":["Comédia"],"trailer":"N/A"},
"11866":{"id":"11866","name":"O Voo da Fênix","slug":"o-voo-da-fenix","original_title":"Flight of the Phoenix","overview":"Após um acidente de avião no Deserto de Gobi, o capitão Frank Towns, seu copiloto e passageiros enfrentam um bando de contrabandistas cruéis e, juntos, tentam reconstruir a aeronave em uma luta pela sobrevivência.","first_air_date":"2004-12-17","runtime":113,"episode_run_time":[113],"vote_average":6.0,"created_by":["Optional Pictures","Davis Entertainment","Aldrich Group","20th Century Fox"],"production_companies":[{"name":"Optional Pictures"},{"name":"Davis Entertainment"},{"name":"Aldrich Group"},{"name":"20th Century Fox"}],"cast":["Dennis Quaid","Tyrese Gibson","Giovanni Ribisi","Miranda Otto","Tony Curran"],"backdrop_path":"https://image.tmdb.org/t/p/original/yzXl6j5CqwA4otpvAtCBeffazly.jpg","poster_path":"https://image.tmdb.org/t/p/original/2ntmTbeS9y2gXcrhLw1wxdLqKSK.jpg","certification":"N/A","genres":["Ação","Aventura","Drama"],"trailer":"N/A"},
"17057":{"id":"17057","name":"No Silêncio da Noite","slug":"no-silencio-da-noite","original_title":"In a Lonely Place","overview":"O roteirista Dixon Steele (Humphrey Bogart) é conhecido por ter um temperamento bem explosivo, o que dificulta um pouco sua carreira. Steele tem a chance de recomeçar roteirizando um livro de grande sucesso, mas como não quer ler o livro convida para ir na sua casa a funcionária da chapelaria Mildred Atkinson (Martha Stewart), para lhe contar a história com suas próprias palavras. Um pouco depois da meia-noite ele diz para Mildred que está cansado, agradece a colaboração, dá a ela o dinheiro do táxi e se despedem. Mas naquela mesma noite ela é morta e Steele é o principal suspeito. Seus antecedentes de comportamento violento e seu macabro senso de humor acabam por complicá-lo ainda mais. Para sua sorte Laurel Gray (Gloria Grahame), sua amável vizinha, lhe proporciona um álibi. Laurel era exatamente o que Steele precisava e a amizade deles rapidamente se transforma em amor, mas talvez as desconfianças, dúvidas e demônios internos de Dixon atrapalhem essa relação.","first_air_date":"1950-05-17","runtime":94,"episode_run_time":[94],"vote_average":7.6,"created_by":["Santana Pictures Corporation","Columbia Pictures"],"production_companies":[{"name":"Santana Pictures Corporation"},{"name":"Columbia Pictures"}],"cast":["Humphrey Bogart","Gloria Grahame","Frank Lovejoy","Carl Benton Reid","Art Smith"],"backdrop_path":"https://image.tmdb.org/t/p/original/hN7P1raiwI0TiZwMkfRekXm26N2.jpg","poster_path":"https://image.tmdb.org/t/p/original/dGxbOr1dFeI53761aDTGfYJQjPl.jpg","certification":"N/A","genres":["Drama","Romance","Mistério","Crime"],"trailer":"N/A"},
"6643":{"id":"6643","name":"O Passado Não Perdoa","slug":"o-passado-nao-perdoa","original_title":"The Unforgiven","overview":"Um estranho Faroeste sobre intolerância racial. Os índios afirmam que Rachel, a filha adotiva de Zachary, é uma Kiowa raptada em um ataque. A disputa faz os outros brancos virarem as costas para o Zacharys quando a verdade é revelada pela mãe. Cash, o irmão impetuoso, reage violentamente ao saber que sua \"irmã\" é uma Pele Vermelha. Ele deixa a família, mas retorna para ajudá-los a lutar contra um ataque de índios durante o qual Rachel mata seu irmão Kiowa, escolhendo assim um lado de uma vez por todas.","first_air_date":"1960-04-06","runtime":125,"episode_run_time":[125],"vote_average":6.2,"created_by":["Hill-Hecht-Lancaster Productions","James Productions","United Artists"],"production_companies":[{"name":"Hill-Hecht-Lancaster Productions"},{"name":"James Productions"},{"name":"United Artists"}],"cast":["Burt Lancaster","Audrey Hepburn","Audie Murphy","John Saxon","Charles Bickford"],"backdrop_path":"https://image.tmdb.org/t/p/original/5Z2lE28UqI2xyhZfTpeFyl8N91J.jpg","poster_path":"https://image.tmdb.org/t/p/original/3PMlfD9bJxy396a4BjhEq0U8I1P.jpg","certification":"e 12","genres":["Faroeste","Drama","Romance"],"trailer":"N/A"},
