"408509":{"id":"408509","name":"Faces de Uma Mulher","slug":"faces-de-uma-mulher","original_title":"Orpheline","overview":"Sandra (Adèle Exarchopoulos) é uma jovem se mudando para Paris, e que tem um leve toque para o desastre. Karine (Solène Rigot) é uma adolescente que passa por infinitas sucessões de fugas, homens e percalços, porque qualquer coisa é melhor que sua família. Kiki (Vega Cuzytek) é uma criança que vive uma tragédia após ser pega em um jogo de esconde-esconde. Renée (Adèle Haenel) é uma mulher estabelecida, que pensava estar livre do seu passado. Aos poucos, entendemos que essas quatro mulheres representam diferentes lados da mesma pessoa.","first_air_date":"2017-03-23","runtime":111,"episode_run_time":[111],"vote_average":5.4,"created_by":["Les Films Hatari","Les Films d'Ici","ARTE France Cinéma","Auvergne-Rhône-Alpes Cinéma"],"production_companies":[{"name":"Les Films Hatari"},{"name":"Les Films d'Ici"},{"name":"ARTE France Cinéma"},{"name":"Auvergne-Rhône-Alpes Cinéma"}],"cast":["Adèle Exarchopoulos","Adèle Haenel","Solène Rigot","Gemma Arterton","Jalil Lespert"],"backdrop_path":"https://image.tmdb.org/t/p/original/1MIs5fcBZ2F8f2tK98L6DxYtP4v.jpg","poster_path":"https://image.tmdb.org/t/p/original/189TaTNLV4ZNHESkJe7cHjV5WK8.jpg","certification":"16","genres":["Drama"],"trailer":"N/A"},
