"363111":{"id":"363111","name":"O Perigo Bate à Porta","slug":"o-perigo-bate-a-porta","original_title":"Wolves at the Door","overview":"Levemente inspirado nos assassinatos da Família Manson, a história mostra quatro amigos que se reúnem em uma aconchegante casa durante o verão de 1969, mas não tem noção de que um grupo de psicopatas estão à espreita do lado de fora. O que começa com uma simples festa de despedida se transforma numa noite de terror quando os visitantes se tornam violentos com os quatro, que são forçados a lutarem por suas vidas","first_air_date":"2016-10-21","runtime":73,"episode_run_time":[73],"vote_average":4.9,"created_by":["New Line Cinema","The Safran Company"],"production_companies":[{"name":"New Line Cinema"},{"name":"The Safran Company"}],"cast":["Katie Cassidy","Elizabeth Henstridge","Adam Campbell","Miles Fisher","Chris Mulkey"],"backdrop_path":"https://image.tmdb.org/t/p/original/jhiEMUkuA4VGKfyvKd31BEG3YSi.jpg","poster_path":"https://image.tmdb.org/t/p/original/2xYrHgNCCIZuDmL6tB8bcYMvibq.jpg","certification":"N/A","genres":["Terror","Thriller"],"trailer":"N/A"},
"1020696":{"id":"1020696","name":"Play Dead: Nos Bastidores Da Morte","slug":"play-dead-nos-bastidores-da-morte","original_title":"Play Dead","overview":"Chloe, uma estudante de criminologia, finge sua própria morte para invadir um necrotério e roubar evidências que ligam seu irmão a um crime. Lá, ela descobre que o legista está usando o necrotério como fachada para o tráfico de órgãos. Ao descobrir que Chloe não está morta, ele inicia uma perseguição aterradora, provando que os mais aterradores não são os mortos, mas sim os vivos.","first_air_date":"2022-12-09","runtime":106,"episode_run_time":[106],"vote_average":6.1,"created_by":["Bradley Pilz Productions","Divide / Conquer","Tubi","Voltage Pictures"],"production_companies":[{"name":"Bradley Pilz Productions"},{"name":"Divide / Conquer"},{"name":"Tubi"},{"name":"Voltage Pictures"}],"cast":["Bailee Madison","Jerry O'Connell","Anthony Turpel","Chris Butler","Chris Lee"],"backdrop_path":"https://image.tmdb.org/t/p/original/lUbt7o9maj8DHEhnHvSv5tIzivg.jpg","poster_path":"https://image.tmdb.org/t/p/original/zeiwFQzyMNp6JBwCfSspG5ZcoLp.jpg","certification":"N/A","genres":["Terror","Thriller"],"trailer":"N/A"},
