"553608":{"id":"553608","name":"Cinderela Pop","slug":"cinderela-pop","original_title":"Cinderela Pop","overview":"Cintia é uma princesa dos dias atuais: antenada, com opiniões próprias, decidida e adora música. Essa princesa pop morava com os pais em um castelo enorme de onde via toda a cidade. Todas as noites, ela olhava pela janela, de onde ficava admirando a vista e sonhando com um príncipe que ainda não conhecia. Porém, um dia, o castelo de Cintia desmoronou e com ele tudo à sua volta. Com a separação dos pais, ela vai morar com a tia, se afasta do pai e, principalmente, deixa de acreditar no amor. Ela só não contava com um detalhe... Havia mesmo um belo príncipe encantando em sua história. E tudo o que ele mais queria era descongelar o coração da nossa gata (nada) borralheira!","first_air_date":"2019-02-28","runtime":95,"episode_run_time":[95],"vote_average":6.5,"created_by":["Panorâmica","Agência Nacional do Cinema - ANCINE","Banco Regional de Desenvolvimento do Extremo Sul","Fundo Setorial do Audiovisual","Miravista"],"production_companies":[{"name":"Panorâmica"},{"name":"Agência Nacional do Cinema - ANCINE"},{"name":"Banco Regional de Desenvolvimento do Extremo Sul"},{"name":"Fundo Setorial do Audiovisual"},{"name":"Miravista"}],"cast":["Maisa Silva","Filipe Bragança","Fernanda Paes Leme","Letícia Pedro","Kiria Malheiros"],"backdrop_path":"https://image.tmdb.org/t/p/original/3tt3tp81aGboViMplQItugAI2RO.jpg","poster_path":"https://image.tmdb.org/t/p/original/uL0TrrV5MHQFkwRxlho0dDKTwvm.jpg","certification":"L","genres":["Romance","Comédia"],"trailer":"owNYIv6CrS8"},
