"13972":{"id":"13972","name":"Mulheres: O Sexo Forte","slug":"mulheres-o-sexo-forte","original_title":"The Women","overview":"Aparentemente Mary Haines (Meg Ryan) leva uma vida perfeita: possui uma linda casa em Connecticut, uma filha de 12 anos, um marido bem-sucedido em Wall Street e uma carreira como designer na loja de roupas de seu pai. Para dar conta também de seus afazeres de casa ela conta com a ajuda da governanta Maggie (Cloris Leachman) e da babá Uta (Tilly Scott Pederson). Sua melhor amiga é Sylvia Fowler (Annette Bening), uma especialista em moda que está no auge da carreira e feliz por estar sozinha. Edie Cohen (Debra Messing), uma grande mãe coruja de seus filhos e também das amigas, e Alex Fisher (Jada Pinkett Smith), uma bem-humorada lésbica que tem o dom de falar o que ninguém espera ouvir, também pertencem ao círculo de amizades de Mary e Sylvia. Juntas elas enfrentam as felicidades e problemas da vida.","first_air_date":"2008-09-12","runtime":114,"episode_run_time":[114],"vote_average":5.1,"created_by":["Jagged Films","Inferno Distribution","Shukovsky English Entertainment"],"production_companies":[{"name":"Jagged Films"},{"name":"Inferno Distribution"},{"name":"Shukovsky English Entertainment"}],"cast":["Meg Ryan","Annette Bening","Eva Mendes","Debra Messing","Jada Pinkett Smith"],"backdrop_path":"https://image.tmdb.org/t/p/original/lrE14a3NfpDhSHHbJaQYScK6aSh.jpg","poster_path":"https://image.tmdb.org/t/p/original/t5IWXVeDfeRhAS51bBVem6GP2uh.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
"203":{"id":"203","name":"Caminhos Perigosos","slug":"caminhos-perigosos","original_title":"Mean Streets","overview":"Harvey Keitel é Charlie, um homem que trabalha para crescer no submundo dos guetos de Little Italy, em Nova York. Ao seu lado, porém, está Johnny Boy, um jovem revoltado, agressivo e sem escrúpulos, que vive se metendo em confusões por causa de dívidas de jogo.","first_air_date":"1973-10-14","runtime":112,"episode_run_time":[112],"vote_average":7.1,"created_by":["Scorsese Productions","Warner Bros. Pictures"],"production_companies":[{"name":"Scorsese Productions"},{"name":"Warner Bros. Pictures"}],"cast":["Harvey Keitel","Robert De Niro","David Proval","Richard Romanus","Amy Robinson"],"backdrop_path":"https://image.tmdb.org/t/p/original/qdecDSIVoqctIoYoOhLH3TgSYLD.jpg","poster_path":"https://image.tmdb.org/t/p/original/yNsh9hqjawnvAXWATmsy8pkNWdM.jpg","certification":"16","genres":["Drama","Crime"],"trailer":"N/A"},
"9966":{"id":"9966","name":"Os Mensageiros","slug":"os-mensageiros","original_title":"The Messengers","overview":"A família Solomon decidiu deixar a vida agitada de Chicago para viver numa pacata fazenda na Dakota do Norte. Logo Jess, a filha adolescente, percebe o quão aterrorizante pode ser o isolamento, pois ela e seu irmão Ben, de apenas 3 anos, vêem aparições que são invisíveis às demais pessoas. Quando estas aparições tornam-se violentas a sanidade de Jess passa a ser questionada por seus pais.","first_air_date":"2007-02-02","runtime":90,"episode_run_time":[90],"vote_average":5.7,"created_by":["Screen Gems","Ghost House Pictures","Columbia Pictures","Blue Star Pictures","Scarecrow Productions","Mandate Pictures"],"production_companies":[{"name":"Screen Gems"},{"name":"Ghost House Pictures"},{"name":"Columbia Pictures"},{"name":"Blue Star Pictures"},{"name":"Scarecrow Productions"},{"name":"Mandate Pictures"}],"cast":["Kristen Stewart","Dylan McDermott","Penelope Ann Miller","John Corbett","William B. Davis"],"backdrop_path":"https://image.tmdb.org/t/p/original/4EqRIeOWBgGGSbBbMG8iQQ4CIcS.jpg","poster_path":"https://image.tmdb.org/t/p/original/uHN1y64WfgVuYxeo5mV3K4at4lM.jpg","certification":"N/A","genres":["Mistério","Thriller","Terror"],"trailer":"N/A"},
"15602":{"id":"15602","name":"Dois Velhos Mais Rabugentos","slug":"dois-velhos-mais-rabugentos","original_title":"Grumpier Old Men","overview":"Dois velhos amigos brigam por vários anos e exceto pelo fato de um deles (Jack Lemmon) ter casado recentemente, parece que nada mais mudou. Mas quando uma bela italiana (Sophia Loren) decide transformar a loja de iscas em um \"ristorante\" as coisas se complicam, se complicando ainda mais quando ela passa a se interessar pelo solteirão (Walter Matthau) da dupla.","first_air_date":"1995-12-22","runtime":101,"episode_run_time":[101],"vote_average":6.5,"created_by":["Lancaster Gate","Warner Bros. Pictures"],"production_companies":[{"name":"Lancaster Gate"},{"name":"Warner Bros. Pictures"}],"cast":["Walter Matthau","Jack Lemmon","Ann-Margret","Sophia Loren","Daryl Hannah"],"backdrop_path":"https://image.tmdb.org/t/p/original/nh9gYaXHTNT9yylX10L9aGqFehy.jpg","poster_path":"https://image.tmdb.org/t/p/original/wXNAhtwiUclUHwrmZLGLhC5fk52.jpg","certification":"N/A","genres":["Romance","Comédia"],"trailer":"N/A"},
"14299":{"id":"14299","name":"Cadillac Records","slug":"cadillac-records","original_title":"Cadillac Records","overview":"1947. O Chess Records é um pequeno estúdio musical, localizado na parte sul de Chicago. De início trabalha o blues, tendo como principais ícones Muddy Waters e Little Walter. Chuck Berry, um dos precursores do rock, também gravou nele. Leonard Chess é o produtor do estúdio e tem um ouvido refinado para identificar diferentes tipos de música. Ele acredita que pode ganhar dinheiro ao assinar com talentos ascendentes do meio musical, como o compositor Willie Dixon e Howlin' Wolf. Leonard os trata como se fosse parte de sua família, o que não é algo simples pela grande quantia gasta para que esta situação aconteça. Quando Chuck Berry é preso, ele decide apostar no talento de outra cantora: Etta James.","first_air_date":"2008-12-05","runtime":108,"episode_run_time":[108],"vote_average":7.1,"created_by":["Parkwood Entertainment"],"production_companies":[{"name":"Parkwood Entertainment"}],"cast":["Adrien Brody","Jeffrey Wright","Gabrielle Union","Columbus Short","Cedric the Entertainer"],"backdrop_path":"https://image.tmdb.org/t/p/original/ubgl0v0crnOGYPGkR2hhIwv7Chm.jpg","poster_path":"https://image.tmdb.org/t/p/original/8PqNPf57ojfh4zvOp3HjodogOKn.jpg","certification":"16","genres":["Drama","História","Música"],"trailer":"N/A"},
