"284674":{"id":"284674","name":"Sem Ar","slug":"sem-ar","original_title":"Air","overview":"Quando uma precipitação nuclear torna a atmosfera irrespirável, dois homens terão de manter saudável o ambiente extremamente frágil do último lugar habitável na Terra e ao mesmo tempo cuidar dos corpos de um grupo de pessoas criogenicamente conservadas, a serem despertas somente quando as condições do planeta permitirem. Para tanto, porém, os guardiões terão de manter a própria sanidade mental na clausura de um bunker subterrâneo.","first_air_date":"2015-08-14","runtime":94,"episode_run_time":[94],"vote_average":5.0,"created_by":["Oddfellows Entertainment","Automatik Entertainment","Circle of Confusion","Skybound Entertainment"],"production_companies":[{"name":"Oddfellows Entertainment"},{"name":"Automatik Entertainment"},{"name":"Circle of Confusion"},{"name":"Skybound Entertainment"}],"cast":["Norman Reedus","Djimon Hounsou","Sandrine Holt","Peter Benson","Michael Hogan"],"backdrop_path":"https://image.tmdb.org/t/p/original/st3saCQAN1q72ws0gHoFLmQ0rL.jpg","poster_path":"https://image.tmdb.org/t/p/original/gu401onHuiZlp4ZTD4Fzj9d80zU.jpg","certification":"N/A","genres":["Ficção científica","Thriller"],"trailer":"N/A"},
