"10849":{"id":"10849","name":"A Rosa Púrpura do Cairo","slug":"a-rosa-purpura-do-cairo","original_title":"The Purple Rose of Cairo","overview":"Em área pobre de Nova Jersey, durante a Depressão, uma garçonete (Mia Farrow) que sustenta o marido bêbado e desempregado, que só sabe ser violento e grosseiro, foge da sua triste realidade assistindo filmes. Mas ao ver pela quinta vez \"A Rosa Púrpura do Cairo\" acontece o impossível! Quando o herói da fita sai da tela para declarar seu amor por ela, isto provoca um tumulto nos outros atores do filme e logo o ator que encarna o herói viaja para lá, tentando contornar a situação. Assim, ela se divide entre o ator e o personagem.","first_air_date":"1985-03-01","runtime":82,"episode_run_time":[82],"vote_average":7.4,"created_by":["Orion Pictures"],"production_companies":[{"name":"Orion Pictures"}],"cast":["Mia Farrow","Jeff Daniels","Danny Aiello","Irving Metzman","Stephanie Farrow"],"backdrop_path":"https://image.tmdb.org/t/p/original/7lHxbtHThosMRZdp9646K4zygVh.jpg","poster_path":"https://image.tmdb.org/t/p/original/w9lczCYLLy2UMvB6z19bRamX0Ke.jpg","certification":"12","genres":["Fantasia","Comédia","Romance"],"trailer":"N/A"},
