"490003":{"id":"490003","name":"Fred Rogers: O Padrinho da Criançada","slug":"fred-rogers-o-padrinho-da-criancada","original_title":"Won't You Be My Neighbor?","overview":"Por mais de trinta anos, e através de seu programa de televisão, Fred Rogers (1928-2003), apresentador, produtor, escritor e pianista, acompanhado de seus bonecos e seus muitos amigos, falou diretamente com crianças pequenas sobre alguns dos assuntos mais importantes da vida.","first_air_date":"2018-06-29","runtime":95,"episode_run_time":[95],"vote_average":8.0,"created_by":["Tremolo Productions","Impact Partners","Independent Lens","PBS"],"production_companies":[{"name":"Tremolo Productions"},{"name":"Impact Partners"},{"name":"Independent Lens"},{"name":"PBS"}],"cast":["Margaret Whitmer","Tom Junod","Joanne Rogers","Jim Rogers","Max King"],"backdrop_path":"https://image.tmdb.org/t/p/original/yrepQdpreOorLyBJyvZkGn3Izfe.jpg","poster_path":"https://image.tmdb.org/t/p/original/xyk4bI7KrfVz7jjYGE7m3QCMAxR.jpg","certification":"N/A","genres":["Documentário"],"trailer":"N/A"},
"18476":{"id":"18476","name":"Os Cavaleiros do Apocalipse","slug":"os-cavaleiros-do-apocalipse","original_title":"Horsemen","overview":"Aidan Breslin (Dennis Quaid), é um policial que endureceu seu ser desde a morte de sua esposa mantendo-se distante dos seus dois filhos pequenos desde então. Sem perceber ele se encontra em uma investigação de impulso perverso e originado por um serial killer enraizado na profecia bíblica dos Quatro Cavaleiros do Apocalipse. Em cada nova revelação no caso, ele lentamente descobre uma chocante ligação entre ele e os quatro suspeitos, como os quatro cavaleiros do Apocalipse e as quatro vítimas independentes. Um mistério com quatro dolorosos segredos.","first_air_date":"2009-02-06","runtime":90,"episode_run_time":[90],"vote_average":5.9,"created_by":["Mandate Pictures","Platinum Dunes","Radar Pictures"],"production_companies":[{"name":"Mandate Pictures"},{"name":"Platinum Dunes"},{"name":"Radar Pictures"}],"cast":["Dennis Quaid","Ziyi Zhang","Lou Taylor Pucci","Clifton Collins Jr.","Barry Shabaka Henley"],"backdrop_path":"https://image.tmdb.org/t/p/original/tUlysdR3Sg4I3i5WCZPKl62SlKu.jpg","poster_path":"https://image.tmdb.org/t/p/original/AvCOBgDUc1OjR7ujgJhm8ZhE6nT.jpg","certification":"N/A","genres":["Crime","Drama","Terror","Mistério","Thriller"],"trailer":"N/A"},
