"2757":{"id":"2757","name":"Adaptação.","slug":"adaptacao","original_title":"Adaptation.","overview":"Charlie Kaufman (Nicolas Cage) precisa de qualquer maneira adaptar para o cinema o romance \"The Orchid Thief\", de Susan Orlean (Meryl Streep). O livro conta a história de John Laroche (Chris Cooper), um fornecedor de plantas que clona orquídeas raras para vendê-las a colecionadores. Porém, além das dificuldades naturais da adaptação de um livro em roteiro de cinema, Charlie precisa lidar também com sua baixa auto-estima, sua frustração sexual e ainda Donald, seu irmão gêmeo que vive como um parasita em sua vida e sonha em também se tornar um roteirista.","first_air_date":"2002-12-06","runtime":115,"episode_run_time":[115],"vote_average":7.4,"created_by":["Columbia Pictures","Propaganda Films","Good Machine","Intermedia","Beverly Detroit Studios","Clinica Estetico"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Propaganda Films"},{"name":"Good Machine"},{"name":"Intermedia"},{"name":"Beverly Detroit Studios"},{"name":"Clinica Estetico"}],"cast":["Nicolas Cage","Meryl Streep","Chris Cooper","Tilda Swinton","Jay Tavare"],"backdrop_path":"https://image.tmdb.org/t/p/original/dh0PHjz4GKgR1PCkB6xH7g6PCuM.jpg","poster_path":"https://image.tmdb.org/t/p/original/rbVczZMHp7nUnXi6na6r0wt3m2v.jpg","certification":"16","genres":["Comédia","Crime","Drama"],"trailer":"t6O4H6IT7r0"},
