"415214":{"id":"415214","name":"Operação Mekong","slug":"operacao-mekong","original_title":"湄公河行动","overview":"Inspirado numa história verdadeira conhecida como o massacre do Mekong – dois navios comerciais chineses são emboscados enquanto viajavam pelo rio Mekong nas águas do Triângulo Dourado, uma das maiores regiões de fabricação de drogas do mundo. 13 marinheiros são executados e 900.000 comprimidos de metanfetamina são recuperados no local. Após a descoberta, o governo chinês envia imediatamente um grupo de elite liderados pelo Capitão Gao Gang para descobrir a verdade por trás dos assassinatos.","first_air_date":"2016-09-30","runtime":123,"episode_run_time":[123],"vote_average":7.0,"created_by":["Film Fireworks Production"],"production_companies":[{"name":"Film Fireworks Production"}],"cast":["Zhang Hanyu","彭于晏","Joyce Feng","Wu Xudong","Zhan Liguo"],"backdrop_path":"https://image.tmdb.org/t/p/original/xUmZHFZa85KxIKzsIdr16oGMjCH.jpg","poster_path":"https://image.tmdb.org/t/p/original/zMJ6QgPVEW4HDigGNL3VNqn3t5d.jpg","certification":"N/A","genres":["Ação","Aventura","Crime","Guerra"],"trailer":"N/A"},
