"7233":{"id":"7233","name":"A Hora da Virada","slug":"a-hora-da-virada","original_title":"Rebound","overview":"Nesta irresistível comédia para toda a família, o \"esquentado\" treinador de basquete Roy McCormick (Martin Lawrence) está mais interessado nos acordos comerciais que fecha do que em ganhar jogos. E depois de um desastre na quadra, Roy está prestes a perder tudo, a menos que possa provar que pode vencer jogos sem perder a calma. E aí que entra a dificuldade ele é obrigado a treinar um inacreditável time de adolescentes que nunca ganhou um jogo. Regulamente, Roy assume o time e usa sua mágica de treinador para ensinar os garotos a importância da dedicação, do trabalho em equipe para trilharem um hilária estrada rumo ao titulo do campeonato. Roy encontra um novo amor durante esse período e redescobre seu verdadeiro primeiro amor: o basquete!","first_air_date":"2005-07-01","runtime":86,"episode_run_time":[86],"vote_average":5.6,"created_by":["Runteldat Entertainment","Robert Simonds Productions","20th Century Fox"],"production_companies":[{"name":"Runteldat Entertainment"},{"name":"Robert Simonds Productions"},{"name":"20th Century Fox"}],"cast":["Martin Lawrence","Wendy Raquel Robinson","Breckin Meyer","Horatio Sanz","Patrick Warburton"],"backdrop_path":"https://image.tmdb.org/t/p/original/pGbnwZHZRaQcjBqQtRiXedD9xlB.jpg","poster_path":"https://image.tmdb.org/t/p/original/lzKhuEM6bf4ypZb4uQqQOqqyPXa.jpg","certification":"10","genres":["Comédia","Família"],"trailer":"N/A"},
