"243684":{"id":"243684","name":"Homens, Mulheres e Filhos","slug":"homens-mulheres-e-filhos","original_title":"Men, Women & Children","overview":"Adultos, adolescentes e crianças amam, sofrem, se relacionam e compartilham tudo, sempre conectados. A internet é onipresente e, nesta grande rede em que o mundo se transformou, as ideias de sociedade e interação social ganham um novo significado. Algumas situações como um casal que não tem intimidade; uma garota que quer ser uma anoréxica melhor; um adolescente que vive em num mundo de pornografia virtual, fazem o expectador repensar a relações humanas.","first_air_date":"2014-10-17","runtime":116,"episode_run_time":[116],"vote_average":6.5,"created_by":["Right of Way Films","Paramount Pictures"],"production_companies":[{"name":"Right of Way Films"},{"name":"Paramount Pictures"}],"cast":["Adam Sandler","Jennifer Garner","Rosemarie DeWitt","Judy Greer","Dean Norris"],"backdrop_path":"https://image.tmdb.org/t/p/original/llGQkYQxnwATVKRYvPTaGMCgQPd.jpg","poster_path":"https://image.tmdb.org/t/p/original/28xrWaYrQ19BPNvUcuySyyXm6kz.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"N/A"},
"785539":{"id":"785539","name":"Fugindo do Amor","slug":"fugindo-do-amor","original_title":"Resort to Love","overview":"Esta comédia romântica gira em torno de Erica (Christina Milian). A moça sonha em ser uma estrela do pop, mas acaba aceitando fazer um show em um resort de luxo nas Ilhas Maurício, sem saber que o evento é o casamento do ex, Jason (Jay Pharoah). Quando percebe onde se meteu, Erica tenta evitar que a noiva, Beverly, descubra essa história, mas se dá conta de que ainda está apaixonada pelo ex. Ainda por cima, o irmão do noivo, Caleb (Sinqua Walls) faz de tudo para impedir que os dois voltem a estar juntos. Essa história romântica, emocionante e divertida explora os laços amorosos e de família. Mas a grande pergunta é: no fim das contas, quem vai se casar com Jason?","first_air_date":"2021-07-29","runtime":101,"episode_run_time":[101],"vote_average":7.2,"created_by":["AK Worldwide","Story Ink"],"production_companies":[{"name":"AK Worldwide"},{"name":"Story Ink"}],"cast":["Christina Milian","Jay Pharoah","Sinqua Walls","Christiani Pitts","Karen Obilom"],"backdrop_path":"https://image.tmdb.org/t/p/original/TB88CYene7rzMs32FzFTLs0eU4.jpg","poster_path":"https://image.tmdb.org/t/p/original/92H1ZRhTMXljh8KA5oI1ZhPe8Gf.jpg","certification":"12","genres":["Romance","Comédia"],"trailer":"N/A"},
