"10126":{"id":"10126","name":"As Cores da Violência","slug":"as-cores-da-violencia","original_title":"Colors","overview":"A polícia e o gabinete do xerife do município de Los Angeles possuem uma divisão para enfrentar os crimes de gangues. Esta divisão da polícia é chamada C.R.A.S.H. (Community Resources Against Street Hoodlums - Esforços Comunitários Contra os Arruaceiros das Ruas) e a divisão do xerife é chamada de O.S.S. (Operation Safe Streets - Operação Ruas Seguras) Os dois departamentos combinados têm um total de 250 integrantes e este é um número bem pequeno, pois na grande Los Angeles existem 600 gangues de rua, que têm quase 70 mil membros, o que provoca centenas de crimes por ano. Neste contexto um novato, Danny McGavin (Sean Penn), e um policial veterano, Bob Hodges (Robert Duvall), viram parceiros na C.R.A.S.H. Eles têm um estilo bem diferente de policiar as ruas, mas independente disto algo precisa ser feito, pois os Crips, que usam azul, e os Bloods, que usam vermelho, as duas principais gangues locais, intensificaram a rivalidade e isto está provocando várias mortes.","first_air_date":"1988-04-15","runtime":127,"episode_run_time":[127],"vote_average":6.5,"created_by":["Orion Pictures"],"production_companies":[{"name":"Orion Pictures"}],"cast":["Sean Penn","Robert Duvall","María Conchita Alonso","Randy Brooks","Grand L. Bush"],"backdrop_path":"https://image.tmdb.org/t/p/original/aWPZsW1rJpcmjnQ7vdsdRu0Mpq5.jpg","poster_path":"https://image.tmdb.org/t/p/original/rSteSEQWCx3J5ndxkyQBUXalntc.jpg","certification":"N/A","genres":["Ação","Crime","Drama"],"trailer":"N/A"},
