"91745":{"id":"91745","name":"Romeu e Julieta","slug":"romeu-e-julieta","original_title":"Romeo & Juliet","overview":"Na cidade de Verona, duas famílias têm uma longa e antiga rixa. Os Montéquio e os Capuletos coexistem sob o olhar severo do Príncipe, mas o ódio entre as famílias ameaça a todos, em particular às crianças. Mas quando o jovem Romeu, um Montéquio, põe os olhos pela primeira vez na imaculada filha dos Capuleto, Julieta, nenhuma inimizade entre as famílias pode impedir que ele se apaixone por ela e ela por ele.","first_air_date":"2013-09-12","runtime":118,"episode_run_time":[118],"vote_average":6.7,"created_by":["Amber Entertainment","Echo Lake Entertainment","Swarovski Entertainment","Icon Productions","Relativity Media"],"production_companies":[{"name":"Amber Entertainment"},{"name":"Echo Lake Entertainment"},{"name":"Swarovski Entertainment"},{"name":"Icon Productions"},{"name":"Relativity Media"}],"cast":["Douglas Booth","Hailee Steinfeld","Damian Lewis","Kodi Smit-McPhee","Natascha McElhone"],"backdrop_path":"https://image.tmdb.org/t/p/original/3MIG7hIJtpuyyytRSr8asm9YLGt.jpg","poster_path":"https://image.tmdb.org/t/p/original/8Y1upcI46HeL3z3iySrVMhfNk63.jpg","certification":"N/A","genres":["Romance","Drama"],"trailer":"N/A"},
