"9304":{"id":"9304","name":"Eu, Minha Mulher e Minhas Cópias","slug":"eu-minha-mulher-e-minhas-copias","original_title":"Multiplicity","overview":"O arquiteto Doug Kinney, ao se sentir pressionado tanto na vida profissional quanto nas obrigações com Laura, sua esposa, e sua filha, sente que sobra pouco tempo para si. Assim, aceita a sugestão de Leeds, um renomado geneticista, em fazer um clone seu para poder substituí-lo em algumas tarefas. Porém, os acontecimentos fogem do controle e logo são três os clones que tumultuam muito e ajudam pouco na vida de Doug.","first_air_date":"1996-07-19","runtime":95,"episode_run_time":[95],"vote_average":5.8,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Michael Keaton","Andie MacDowell","Harris Yulin","Eugene Levy","Zack Duhame"],"backdrop_path":"https://image.tmdb.org/t/p/original/pfgUk6IgobtEhisyJBBrjSVkfZR.jpg","poster_path":"https://image.tmdb.org/t/p/original/opNWJgLBAmNxbQt8rZhQKomSvEL.jpg","certification":"N/A","genres":["Comédia","Fantasia","Ficção científica","Romance"],"trailer":"N/A"},
