"15765":{"id":"15765","name":"Tina - A Verdadeira História de Tina Turner","slug":"tina-a-verdadeira-historia-de-tina-turner","original_title":"What's Love Got to Do with It","overview":"A verdadeira história da lenda viva do rock´n roll, Tina Turner, com Angela Bassette e Laurence Fishburne. Tina é Anna Mae Bullock, uma garota do interior com uma voz especial que se apaixona pelo carismático Ike Turner. Juntos, conquistam o sucesso no mundo da música. Mas quando perdem o controle de suas vidas, a volta à realidade provoca um choque inevitável. Do fundo do poço ao mais alto nível, Tina viveu, sobreviveu e triunfou. Cheio de energia e performances eletrizantes, um filme que vai fazer você cantar, dançar e aplaudir.","first_air_date":"1993-06-09","runtime":117,"episode_run_time":[117],"vote_average":7.1,"created_by":["Touchstone Pictures"],"production_companies":[{"name":"Touchstone Pictures"}],"cast":["Angela Bassett","Laurence Fishburne","Vanessa Bell Calloway","Jenifer Lewis","Khandi Alexander"],"backdrop_path":"https://image.tmdb.org/t/p/original/ow5u27LapD6xMe24o2ITnZDoz7z.jpg","poster_path":"https://image.tmdb.org/t/p/original/vcEYnCzlFtjSjYfueJNMW99X49i.jpg","certification":"N/A","genres":["Drama","Música","História"],"trailer":"N/A"},
"19267":{"id":"19267","name":"O Grande Lutador","slug":"o-grande-lutador","original_title":"The Big Brawl","overview":"Este é o primeiro filme americano de Jackie Chan. Em \"O Grande Lutador\" o ator interpreta um imigrante que segue rumo aos EUA para ajudar e proteger o restaurante de seu avô. Quando gangsteres da cidade sequestram sua cunhada, ele é obrigado a entrar num torneio de luta para resgatá-la. Um forte mafioso de Chicago chantageia o jovem lutador de Kung Fu, afim de que o rapaz derrote, em um campeonato mundial de lutas marciais, o campeão invicto da categoria, patrocinado pelo chefe da máfia de Pittsburg.","first_air_date":"1980-08-18","runtime":95,"episode_run_time":[95],"vote_average":5.9,"created_by":["Orange Sky Golden Harvest","Warner Bros. Pictures"],"production_companies":[{"name":"Orange Sky Golden Harvest"},{"name":"Warner Bros. Pictures"}],"cast":["Jackie Chan","Mako","Kristine DeBell","José Ferrer","Rosalind Chao"],"backdrop_path":"https://image.tmdb.org/t/p/original/qAXtKR6CaLrMSCYIDjRkmJFRIbj.jpg","poster_path":"https://image.tmdb.org/t/p/original/nyuRx4e4hBWV2CpqhMfJISmIvOf.jpg","certification":"N/A","genres":["Ação","Comédia"],"trailer":"N/A"},
