"141043":{"id":"141043","name":"Uma Longa Queda","slug":"uma-longa-queda","original_title":"A Long Way Down","overview":"Na noite de Ano Novo, quatro pessoas solitárias se encontram no topo de um prédio. Curiosamente, todos têm o mesmo plano: cometer suicídio. Diante da ironia da situação, eles se tornam amigos, e fazem um pacto: nenhum deles se matará até o Dia dos Namorados, em fevereiro. Nos meses que se seguem, os quatro acabam ajudando uns aos outros.","first_air_date":"2014-03-20","runtime":96,"episode_run_time":[96],"vote_average":6.2,"created_by":["BBC Film","Wildgaze Films","Finola Dwyer Productions","HanWay Films","DCM Pictures"],"production_companies":[{"name":"BBC Film"},{"name":"Wildgaze Films"},{"name":"Finola Dwyer Productions"},{"name":"HanWay Films"},{"name":"DCM Pictures"}],"cast":["Pierce Brosnan","Aaron Paul","Imogen Poots","Toni Collette","Sam Neill"],"backdrop_path":"https://image.tmdb.org/t/p/original/cA2lXcl4rVKsRltJwVYRqpSqvhq.jpg","poster_path":"https://image.tmdb.org/t/p/original/dqsF7ZiiUeAh2Zz1kCPLCMEy1K2.jpg","certification":"12","genres":["Comédia","Drama"],"trailer":"8lKeAkAFcdg"},
"10178":{"id":"10178","name":"A Nave da Revolta","slug":"a-nave-da-revolta","original_title":"The Caine Mutiny","overview":"Durante a 2ª Guerra Mundial Willie Keith (Robert Francis), um jovem oficial, se incorpora à tripulação do Caine, um navio de menor porte que funciona como caça-minas. O imediato Steve Maryk (Van Johnson) e o tenente Tom Keefer (Fred MacMurray) também fazem parte do staff. Logo depois da chegada de Willie, o capitão DeVriess (Tom Tully) é substituído pelo capitão Philip Francis Queeg (Humphrey Bogart), que logo impõe sua autoridade e sua neurose acerca de limpeza, pois é de seu intento comandar um navio imaculado, onde até uma camisa fora de calça é motivo de séria advertência. Esta neurose faz com que ele se distraia e navegue em círculos, além de cortar seu próprio cabo de reboque. Incidentes adicionais indicam que Queeg está sofrendo de stress. Maryk acha estranho o comportamento do capitão e Keefer insidiosamente planta a semente, dizendo que Queeg está próximo de um colapso nervoso. e 10.","first_air_date":"1954-06-24","runtime":124,"episode_run_time":[124],"vote_average":7.1,"created_by":["Stanley Kramer Productions","Columbia Pictures"],"production_companies":[{"name":"Stanley Kramer Productions"},{"name":"Columbia Pictures"}],"cast":["Humphrey Bogart","Robert Francis","Van Johnson","Fred MacMurray","May Wynn"],"backdrop_path":"https://image.tmdb.org/t/p/original/bZZF2EeljlEPHCagm4nSTlOub4A.jpg","poster_path":"https://image.tmdb.org/t/p/original/vuO4Z3wOWVlhq35MS9asZeT9rVp.jpg","certification":"N/A","genres":["Drama","Guerra"],"trailer":"N/A"},
