"309304":{"id":"309304","name":"Aprendendo Com a Vovó","slug":"aprendendo-com-a-vovo","original_title":"Grandma","overview":"Elle Reid (Lily Tomlin) se fechou para o mundo após perder sua parceira, com quem viveu durante 38 anos. Antissocial e com um senso de humor ácido, ela terá que sair de \"sua bolha de proteção\" quando sua neta pede ajuda. As duas enfrentam uma viagem de um dia, que faz Ellie ter que confrontar seu passado e florescer, enquanto a jovem terá que se preparar para enfrentar o futuro.","first_air_date":"2015-06-04","runtime":78,"episode_run_time":[78],"vote_average":6.5,"created_by":["1821 Pictures","Depth of Field"],"production_companies":[{"name":"1821 Pictures"},{"name":"Depth of Field"}],"cast":["Lily Tomlin","Julia Garner","Marcia Gay Harden","Judy Greer","Laverne Cox"],"backdrop_path":"https://image.tmdb.org/t/p/original/kiVn09vghnscMWMqlX8uoQuXtMW.jpg","poster_path":"https://image.tmdb.org/t/p/original/baK7IG3fZjReGtidXcZQZrUzIwb.jpg","certification":"16","genres":["Comédia","Drama"],"trailer":"N/A"},
"16161":{"id":"16161","name":"Baby Boy: O Dono da Rua","slug":"baby-boy-o-dono-da-rua","original_title":"Baby Boy","overview":"Jody (Tyrese) é um jovem de 20 anos que se vê em meio a uma série de problemas: ele está atualmente desempregado, tem dois filhos e não suporta o atual namorado de sua mãe. Jody deseja sair de casa e recomeçar sua vida com a atual namorada, mas a mãe de seus filhos sempre o acaba prendendo na atual casa. Em meio a estes problemas, Jody ainda tem que lidar com o fato de seu melhor amigo estar disposto a voltar para uma gangue de rua e de que o namorado de uma ex-namorada está atrás dele.","first_air_date":"2001-06-27","runtime":130,"episode_run_time":[130],"vote_average":7.1,"created_by":["New Deal Productions","Columbia Pictures"],"production_companies":[{"name":"New Deal Productions"},{"name":"Columbia Pictures"}],"cast":["Tyrese Gibson","Taraji P. Henson","Omar Gooding","Ving Rhames","Snoop Dogg"],"backdrop_path":"https://image.tmdb.org/t/p/original/wyMfhalkfbEjrAnvlqs9zOnDsCZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/d9b5sDAY2q2u2fWFYZPmt0Cl2p7.jpg","certification":"N/A","genres":["Crime","Drama","Romance","Thriller"],"trailer":"N/A"},
"114955":{"id":"114955","name":"Let It Shine","slug":"let-it-shine","original_title":"Let It Shine","overview":"Cyrus é um talentoso jovem compositor que ambiciona fazer carreira no rap e conquistar seu amor, Roxanne. Tímido, não tem coragem de subir num palco, tampouco de declarar seus sentimentos. Ele cede ao amigo Kris uma balada que escreveu para Roxanne e a garota fica encantada com as palavras, sem imaginar que elas vieram na verdade de Cyrus.","first_air_date":"2012-06-15","runtime":105,"episode_run_time":[105],"vote_average":6.9,"created_by":["GWave Productions","Walt Disney Television"],"production_companies":[{"name":"GWave Productions"},{"name":"Walt Disney Television"}],"cast":["Tyler James Williams","Coco Jones","Trevor Jackson","Brandon Mychal Smith","Dawnn Lewis"],"backdrop_path":"https://image.tmdb.org/t/p/original/1ZDG6VJFd2t92dZAScCqti0QPAg.jpg","poster_path":"https://image.tmdb.org/t/p/original/h0tbtqdPPCe7gYSuNppOd066xBL.jpg","certification":"L","genres":["Família","Música","Cinema TV"],"trailer":"N/A"},
