"440642":{"id":"440642","name":"Spacewalker: Rumo ao Desconhecido","slug":"spacewalker-rumo-ao-desconhecido","original_title":"Время первых","overview":"Em março de 1965, a União Soviética e os Estados Unidos disputavam o primeiro lugar na corrida pela conquista espacial e o próximo e ambicioso passo era fazer um homem \"caminhar\" em pleno espaço sideral. Dois cosmonautas russos, Aleksei Leonov e Pavel Belyayev, se lançam na missão Voskhod 2 com o objetivo de serem os pioneiros desta façanha. Sendo o primeiro ser humano a deixar a nave em um traje espacial e realizar uma caminhada de doze minutos, Leonov entra para a história, mas não sem enfrentar inúmeras dificuldades e perigos, antes e depois da concretização do seu feito.","first_air_date":"2017-04-06","runtime":140,"episode_run_time":[140],"vote_average":7.0,"created_by":["Bazelevs Production"],"production_companies":[{"name":"Bazelevs Production"}],"cast":["Евгений Миронов","Константин Хабенский","Владимир Ильин","Анатолий Котенёв","Александра Урсуляк"],"backdrop_path":"https://image.tmdb.org/t/p/original/t4YhlPbrloOjukZLKol9dhfDyxS.jpg","poster_path":"https://image.tmdb.org/t/p/original/rdd6ZQK2yHACbtpWrMd5JSXsqk0.jpg","certification":"10","genres":["Aventura","Drama","História","Thriller"],"trailer":"Om-TUQ2kqf4"},
"243940":{"id":"243940","name":"Renascida do Inferno","slug":"renascida-do-inferno","original_title":"The Lazarus Effect","overview":"Um grupo de cientistas está fazendo uma pesquisa sobre o cérebro humano, buscando uma fórmula capaz de reanimar animais que acabam de morrer. Durante um dos experimentos, a pesquisadora Zoe sofre uma descarga elétrica e morre dentro do laboratório. Desesperados para trazê-la de volta à vida, eles aplicam o medicamento experimental na colega, fazendo com que ela acorde. Apesar de estar viva, Zoe manifesta um comportamento estranho, como se estivesse possuída por forças malignas. Enquanto tentam se proteger do perigo, eles também devem impedir que a amiga fuja do laboratório e mate as pessoas ao redor.","first_air_date":"2015-01-29","runtime":83,"episode_run_time":[83],"vote_average":5.3,"created_by":["Lionsgate","Blumhouse Productions","Chapter One Films","Relativity Media"],"production_companies":[{"name":"Lionsgate"},{"name":"Blumhouse Productions"},{"name":"Chapter One Films"},{"name":"Relativity Media"}],"cast":["Mark Duplass","Olivia Wilde","Donald Glover","Evan Peters","Sarah Bolger"],"backdrop_path":"https://image.tmdb.org/t/p/original/zFhsM6HJ9abLZZlkz9mOY5uGE1M.jpg","poster_path":"https://image.tmdb.org/t/p/original/7ioygTHhBTbzipBRuzCnb9OqI3p.jpg","certification":"14","genres":["Terror","Ficção científica","Thriller"],"trailer":"4LQx2rrS9vo"},
"65851":{"id":"65851","name":"Jackass 3.5","slug":"jackass-3-5","original_title":"Jackass 3.5","overview":"Aqueles que tiveram coragem de assistir Jackass 3D nos cinemas provavelmente acharam que nunca mais veriam coisas tão bizarras e nojentas. Não, março de 2011 ainda guarda muito mais mal estar para o seu estômago. A MTV acaba de anunciar o lançamento de Jackass 3.5, uma compilação de cenas inéditas do filme a serem lançadas na internet.","first_air_date":"2011-04-01","runtime":85,"episode_run_time":[85],"vote_average":6.3,"created_by":["Paradise F.X. Corp.","Dickhouse Productions","Film Roman","MTV Films"],"production_companies":[{"name":"Paradise F.X. Corp."},{"name":"Dickhouse Productions"},{"name":"Film Roman"},{"name":"MTV Films"}],"cast":["Johnny Knoxville","Ryan Dunn","Dave England","Preston Lacy","Bam Margera"],"backdrop_path":"https://image.tmdb.org/t/p/original/9KjZEJP39j3K6yXT7nCOrp5Ko2A.jpg","poster_path":"https://image.tmdb.org/t/p/original/ywSiFAcYHm40NB0iJoWMwIAEDuI.jpg","certification":"N/A","genres":["Comédia","Documentário","Ação"],"trailer":"N/A"},
"449749":{"id":"449749","name":"Ella e John","slug":"ella-e-john","original_title":"The Leisure Seeker","overview":"​O Caçador de Lazer é o apelido que Ella e John Spencer deram a seu trailer, que usavam para tirar férias com os filhos nos anos 1970. Hoje, já na terceira idade e loucos para fugir de uma vida de cuidados médicos, o casal volta a embarcar no veículo e parte em direção a Key West para uma nova aventura. A viagem por uma América que já não reconhecem mais – misturando momentos hilários com outros de puro terror – é a chance para retomarem uma vida de paixão e devoção, mas também de obsessões secretas que ressurgem abruptamente.","first_air_date":"2018-01-03","runtime":112,"episode_run_time":[112],"vote_average":7.1,"created_by":["Indiana Production","Bac Films","3 Marys Entertainment","RAI Cinema","Regione Lazio","Focus Features","Sony Pictures Classics"],"production_companies":[{"name":"Indiana Production"},{"name":"Bac Films"},{"name":"3 Marys Entertainment"},{"name":"RAI Cinema"},{"name":"Regione Lazio"},{"name":"Focus Features"},{"name":"Sony Pictures Classics"}],"cast":["Helen Mirren","Donald Sutherland","Christian McKay","Janel Moloney","Dana Ivey"],"backdrop_path":"https://image.tmdb.org/t/p/original/lZc28Tk0m92CIzzi60qJwieLYMx.jpg","poster_path":"https://image.tmdb.org/t/p/original/vVxbWZuUOopIqN9ObJqPNL9k703.jpg","certification":"N/A","genres":["Drama","Romance","Aventura"],"trailer":"N/A"},
