"16642":{"id":"16642","name":"Cinzas no Paraíso","slug":"cinzas-no-paraiso","original_title":"Days of Heaven","overview":"Em 1916, Bill, um trabalhador de Chicago, mata o chefe da usina siderúrgica em que trabalha. Ele foge para o Texas com sua namorada Abby e sua irmã mais nova, Linda. Para evitar fofocas, Bill e Abby fingem ser irmãos e são contratados como parte de um grupo sazonal para trabalhar nos campos de trigo de um rico fazendeiro, o qual descobre estar morrendo de uma doença não identificada. Quando ele apaixona-se por Abby, Bill encoraja sua namorada a casar-se com o fazendeiro para herdar seu dinheiro.","first_air_date":"1978-09-13","runtime":94,"episode_run_time":[94],"vote_average":7.5,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Richard Gere","Brooke Adams","Sam Shepard","Linda Manz","Robert J. Wilke"],"backdrop_path":"https://image.tmdb.org/t/p/original/9Upbup1xrQuTDbspIh9aytEH5xA.jpg","poster_path":"https://image.tmdb.org/t/p/original/3F16pdce2sS8N4GCFTwOVmJMBGC.jpg","certification":"12","genres":["Drama","Romance"],"trailer":"N/A"},
