"4952":{"id":"4952","name":"Confidências à Meia-Noite","slug":"confidencias-a-meia-noite","original_title":"Pillow Talk","overview":"Em Nova York, a decoradora de interiores Jan Morrow (Doris Day) e o compositor mulherengo Brad Allen (Rock Hudson) usam a mesma linha compartilhada, mas Brad mantém ocupada a maior parte do tempo flertando com suas namoradas. Eles não se conhecem, mas Jan odeia Brad porque ela precisa do telefone para o seu negócio e não pode usá-lo. Coincidentemente cliente rico que Jan corteja, Jonathan Forbes, é o melhor amigo de Brad e comenta com ele que tem um amor não correspondido por Jan, que é uma mulher linda. Quando Brad encontra Jan por acaso em um restaurante, ele se apresenta como um turista ingênuo do Texas chamado Rex Stetson e a seduz. Mas Jonathan contrata um detetive particular para descobrir quem é Rex Stetson. (e 10)","first_air_date":"1959-10-07","runtime":102,"episode_run_time":[102],"vote_average":7.1,"created_by":["Arwin Productions"],"production_companies":[{"name":"Arwin Productions"}],"cast":["Doris Day","Rock Hudson","Tony Randall","Thelma Ritter","Nick Adams"],"backdrop_path":"https://image.tmdb.org/t/p/original/cPDMOeafVmyguVlwE4ls6HER021.jpg","poster_path":"https://image.tmdb.org/t/p/original/9J905v3dDr2FyTNESXjuZV2ztgx.jpg","certification":"e 10","genres":["Comédia","Romance"],"trailer":"N/A"},
